  'txtAboutWorkoutAns1': "വ്യായാമ സമയത്ത് എന്തെങ്കിലും അസ്വസ്ഥത സംഭവിക്കുകയാണെങ്കിൽ, ഉടൻ തന്നെ വ്യായാമം ചെയ്യുക, ഡോക്ടറിലേക്ക് പോകുക.",
  'txtAboutWorkoutAns2': "നല്ല ജോലി! നിങ്ങളുടെ ഫലങ്ങൾ ശക്തിപ്പെടുത്തുന്നതിനായി നിങ്ങൾക്ക് 30 ദിവസത്തെ ട്രെയിൻ-ഇംഗോ ആവർത്തിക്കാം, അല്ലെങ്കിൽ പ്ലാൻ പേജിൽ നിങ്ങൾക്ക് താൽപ്പര്യമുള്ള കൂടുതൽ പരിശീലനം കണ്ടെത്താനാകും.",
  'txtAboutWorkoutAns3': "ഈ അപ്ലിക്കേഷൻ സുരക്ഷിതമായി ശരീരഭാരം കുറയ്ക്കാൻ സഹായിക്കും. നിങ്ങൾക്ക് ഒറ്റരാത്രികൊണ്ട് ശരീരഭാരം കുറയ്ക്കാൻ കഴിയില്ല.\n\nSEN നഷ്ടമായ ഭാരം ഒരു ദീർഘകാല പ്രക്രിയയാണ്, നിങ്ങൾ അതിൽ ഉറച്ചുനിൽക്കേണ്ടതുണ്ട്",
  'txtAboutPaymentAns1': "1. നിങ്ങളുടെ പുതിയ ഉപകരണത്തിലെ അപ്ലിക്കേഷൻ Google Play- ൽ നിന്ന് ഡ download ൺലോഡ് ചെയ്തിട്ടുണ്ടെന്ന് ഉറപ്പാക്കുക.\n\n2. നിങ്ങൾ ഉപയോഗിക്കുന്ന അക്കൗണ്ട് നിങ്ങൾ ഉപയോഗിച്ചതിന് സമാനമാണെന്ന് ഉറപ്പാക്കുക.\n\n3. അപ്ലിക്കേഷൻ പുനരാരംഭിക്കുക, ഇത് നിങ്ങളുടെ പ്രീമിയം പതിപ്പിലേക്ക് യാന്ത്രികമായി പഴയപടിയാക്കും.",
  'txtAboutPaymentAns2': "Google Play -v സബ്സ്ക്രിപ്ഷനുകൾ -> സ്ത്രീകൾക്കായി ഭാരം കുറയ്ക്കുക -> സബ്സ്ക്രിപ്ഷൻ റദ്ദാക്കുക",
  'txtAboutPaymentAns3': "നിങ്ങൾ സബ്സ്ക്രിപ്ഷൻ റദ്ദാക്കുന്നില്ലെങ്കിൽ, നിലവിലെ കാലയളവ് അവസാനിക്കുന്നതിന് 24 മണിക്കൂറിനുള്ളിൽ 24 മണിക്കൂറിനുള്ളിൽ നിങ്ങളുടെ എസി-എണ്ണം ഈടാക്കും. നിങ്ങളുടെ സബ്സ്ക്രിപ്ഷൻ നില കണ്ടെത്തുന്നതിന് പ്ലേ സ്റ്റോറിന്റെ സബ്സ്ക്രിപ്ഷൻ പേജ് പരിശോധിക്കുക.",
  'txtAboutPaymentAns4': "Google Play വഴി നിർമ്മിച്ച എല്ലാ പേയ്മെന്റുകളും Google നിയന്ത്രിക്കുകയും നിയന്ത്രിക്കുകയും ചെയ്യുന്നു.\n\nif സബ്സ്ക്രിപ്ഷൻ റദ്ദാക്കാൻ നിങ്ങൾ മറന്നു അല്ലെങ്കിൽ അബദ്ധവശാൽ സബ്സ്ക്രൈബുചെയ്യാൻ നിങ്ങൾ മറന്നു, കൂടുതൽ വിവരങ്ങൾക്ക് ദയവായി Google നാടകവുമായി ബന്ധപ്പെടുക.",
  'txtAboutPaymentAns5': "നിങ്ങൾ അപ്ലിക്കേഷൻ അൺഇൻസ്റ്റാൾ ചെയ്തിട്ടുണ്ടെങ്കിൽ, സബ്സ്ക്രിപ്ഷൻ റദ്ദാക്കരുത്, നിങ്ങളുടെ അക്കൗണ്ടിന് ഇപ്പോഴും Google Play വരെ ഈടാക്കും.",
