  'ex_desc_1': "നിങ്ങളുടെ ആയുധങ്ങൾ തോളിൽ ഉയരത്തിൽ വലതുവശത്ത് നിൽക്കുക.\n\n തോളിൽ ഉയരത്തിൽ.\n\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാം.\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാൻ.\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാനുള്ളത്. ഡെൽറ്റോയ്ഡ് പേശി.",
  'ex_desc_2': "നിങ്ങളുടെ പാദങ്ങളിൽ നിന്ന് നിങ്ങളുടെ വശങ്ങളിൽ നിന്ന് നിങ്ങളുടെ വശങ്ങളിൽ നിന്ന് ആരംഭിക്കുക, എന്നിട്ട് നിങ്ങളുടെ പാദങ്ങളും നിങ്ങളുടെ കൈകളും മുകളിലേക്ക് പോകുക.\n\nRethe ആരംഭ സ്ഥാനത്തേക്ക് ഒരു ഫുൾ-ബോഡി വ്യായാമം ചെയ്യുക നിങ്ങളുടെ എല്ലാ വലിയ പേശി ഗ്രൂപ്പുകളും പ്രവർത്തിക്കുന്നു.",
  'ex_desc_3': "നിങ്ങളുടെ വശങ്ങളിലൂടെ നിങ്ങളുടെ പാദങ്ങൾ ഉപയോഗിച്ച് നിവർന്നുനിൽക്കുക. നിങ്ങളുടെ വശങ്ങളാൽ കൈകൾ നിവർന്നുനിൽക്കുക.\n ഒരു കാൽ വരാനിരിക്കുക, നിങ്ങളുടെ കൈകൾ ഉയർത്തി നിങ്ങളുടെ കൈകൾ മുകളിലേക്ക് കൊണ്ടുവരിക.\n return, സ്വിച്ച് ഹെഡ്, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_4': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയും നിങ്ങളുടെ അർമായും മുന്നോട്ട് നീട്ടി, നിങ്ങളുടെ തുടകൾ തറയിൽ സമാന്തരമായി നീണ്ടുനിൽക്കും.\n\n കാൽമുട്ടുകൾ നിങ്ങളുടെ കാൽവിരലുകളായി ഒരേ ദിശയിൽ നീട്ടിയിരിക്കുന്നു. അടുത്ത റെപ് ചെയ്യുക.\n\n തുടകൾ, ഇടുപ്പ് നിതംബം, ക്വാഡുകൾ, ഹാംസ്ട്രിംഗുകൾ, താഴത്തെ ശരീരം എന്നിവയാണ്.",
  'ex_desc_5': "നിങ്ങളുടെ തോട്ടിലും കൈകളിലും മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ തോളുകൾക്ക് കീഴിൽ നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ വലതു കാൽ ഉയർത്തി നിങ്ങളുടെ നിതംബം ഉയർത്തുക, നിങ്ങൾക്ക് കഴിയുന്നത്ര.\n ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.",
  'ex_desc_6': "നിങ്ങളുടെ തോളുകിലും കൈകളിലും മുട്ടുകുത്തി നിൽക്കുക.\n\n നിങ്ങളുടെ ഇടത് കാൽ ഉയർത്തുക, നിങ്ങൾക്ക് കഴിയുന്നത്ര നിങ്ങളുടെ ബട്ട് പിഴിഞ്ഞെടുക്കുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.",
  'ex_desc_7': "നിങ്ങളുടെ പുറകിൽ മുട്ടുകുത്തി തറയിൽ പരന്നുകിടക്കുക.\n\n നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ ആയുധങ്ങൾ പരന്നുകിടക്കുന്നു.\n നിങ്ങളുടെ വശങ്ങളിൽ പരന്നതാണ്.",
  'ex_desc_8': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ കൈകൾക്കു കീഴിലുള്ള നിങ്ങളുടെ തോളുകൾക്ക് കീഴിൽ ആരംഭിക്കുക.\n ഒരു ശ്വാസം എടുത്ത് നിങ്ങളുടെ വയറു താഴേക്ക് വീഴുകയും തോളുകൾ പിന്നിലേക്ക് ഉയർത്തുകയും ചെയ്യും. നിങ്ങളുടെ ബാക്ക് മുകളിലേക്ക് നട്ടെ, നിങ്ങളുടെ തല താഴേക്ക് വരാൻ അനുവദിക്കുക.\n\n വ്യായാമത്തിന്റെ ഓരോ ഘട്ടത്തിലും ഇത് പതുക്കെ അത് ഉപേക്ഷിക്കുക.",
  'ex_desc_9': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയും വേർപിരിയുക.\n നിങ്ങളുടെ കാൽമുട്ടിനെ നിങ്ങളുടെ എതിർ കൈമുട്ടിലേക്ക്.\n\n\n ആരംഭിക്കുന്ന സ്ഥാനത്തേക്ക്, മറുവശത്ത് ആവർത്തിക്കുക.",
  'ex_desc_10': "ഒരു ബെഞ്ചിൽ നിന്ന് നിരവധി അടി അകലെ നിൽക്കുക. നിങ്ങളുടെ പിന്നിൽ നിങ്ങളുടെ ഇടത് കാൽ നിങ്ങളുടെ പിന്നിലെ ബെഞ്ചിൽ വിശ്രമിക്കുക.\n\n നിങ്ങളുടെ ശരീരം തറയിൽ മുഴുകുന്നതുവരെ നിങ്ങളുടെ മുൻവശത്ത് തറയ്ക്ക് സമാന്തരമാണ്.\nth nth nthen graneen ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, വ്യായാമം ആവർത്തിക്കുക.\nനിങ്ങളുടെ മുൻ കാൽമുട്ടിന് നിങ്ങളുടെ കാൽമുട്ടിന് മുകളിലൂടെ പോകുന്നതിനായി നിങ്ങളുടെ മുൻ കാലും ബെഞ്ചിനും ഇടയിൽ മതിയായ ഇടമായിരിക്കണം nther. നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ നേരെയാക്കുക.\n\nഗ്ലൂയൂസിനും ഹാംസ്ട്രിംഗിനും ഒരു മികച്ച വ്യായാമത്തിന് ഒരു മികച്ച വ്യായാമത്തിന് കാരണമാകുന്നു.",
  'ex_desc_11': "ഒരു ബെഞ്ചിൽ നിന്ന് നിരവധി അടി അകലെ നിൽക്കുക. നിങ്ങളുടെ പിന്നിൽ നിങ്ങളുടെ വലതു കാൽ വിശ്രമിക്കുക.\n\n നിങ്ങളുടെ ശരീരം തറയിൽ മുഴുകുന്നതുവരെ നിങ്ങളുടെ മുൻവശത്ത് തറയ്ക്ക് സമാന്തരമാണ്.\n\nth nth ntheen ആരംഭ സ്ഥാനത്തേക്ക് തിരികെ പോയി വ്യായാമം ആവർത്തിക്കുക.\nനിങ്ങളുടെ മുൻ കാൽമുട്ടിന് നിങ്ങളുടെ കാൽമുട്ടിന് മുകളിലൂടെ പോകുന്നതിനായി നിങ്ങളുടെ മുൻ കാലും ബെഞ്ചിനും ഇടയിൽ മതിയായ ഇടമായിരിക്കണം nther. നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ നേരെയാക്കുക.\n\nഗ്ലൂയൂസിനും ഹാംസ്ട്രിംഗിനും ഒരു മികച്ച വ്യായാമത്തിന് ഒരു മികച്ച വ്യായാമത്തിന് കാരണമാകുന്നു.",
  'ex_desc_12': "നിങ്ങളുടെ കാലുകളിലൊന്ന് മുന്നോട്ട് നിൽക്കുകയും നിങ്ങളുടെ കാൽമുട്ടുകൾ ചെറുതായി വളയുകയും ചെയ്യുക. നിങ്ങളുടെ കൈമുട്ട് വളച്ച് നിങ്ങളുടെ മുഷ്ടി നിങ്ങളുടെ മുഖത്തിന് മുന്നിൽ വിളിക്കുക.\n\nഒരു ഭുജം തറ അഭിമുഖീകരിക്കുന്നു. കൈ തിരിച്ചുപിടിച്ച് മറ്റ് കൈകൊണ്ട് ആവർത്തിക്കുക.",
  'ex_desc_13': "നേരായ ഭുജം പ്ലാങ്ക് സ്ഥാനത്ത് ആരംഭിക്കുക. തുടർന്ന്\nനാൽപഥത്തിൽ രണ്ട് കാലുകളും താഴും കുറയ്ക്കുക,\n.",
  'ex_desc_14': "നിങ്ങളുടെ വയറ്റിൽ കിടന്ന് കൈമുട്ട് നിങ്ങളുടെ ചുമരിൽ കൈകൊണ്ട് വളയ്ക്കുക.\n നിങ്ങളുടെ തോളിനു താഴെ നിങ്ങളുടെ തോളിനു താഴെ വളയ്ക്കുക.\n നിങ്ങളുടെ നെഞ്ചിനെ നിങ്ങളുടെ നെഞ്ചിനെ കഴിയുന്നിടത്തോളം നിലത്തുനിന്ന് നിലത്തേക്ക് നീക്കുന്നു. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, ആവർത്തിക്കുക.",
  'ex_desc_15': "നിങ്ങളുടെ വലതു കൈ ഉയർത്തിയ ഓവർഹെഡും നിങ്ങളുടെ അരയിൽ ഇടത് കൈയും ഉപയോഗിച്ച് നിൽക്കുക.\nനിങ്ങളുടെ വലത് കൈമുട്ട്, വലത് കാൽമുട്ട് എന്നിവ പരസ്പരം കണ്ടുമുട്ടാൻ. നീട്ടി ആവർത്തിക്കുക.",
  'ex_desc_16': "നിങ്ങളുടെ ഇടത് കൈകൊണ്ട് ഉയർത്തി, നിങ്ങളുടെ അരയിൽ വലതു കൈകൊണ്ട് നിൽക്കുക.\n നിങ്ങളുടെ ഇടത് കൈമുട്ടിനെ പരസ്പരം കണ്ടുമുട്ടുകയും പരസ്പരം കണ്ടുമുട്ടുകയും ചെയ്യുന്നു. നീട്ടി ആവർത്തിക്കുക.",
  'ex_desc_17': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക 90 ഡിഗ്രി കോണിലും നിങ്ങളുടെ കൈകളിലും നിങ്ങളുടെ കൈകളിലും കിടക്കുക.\n\n നിങ്ങളുടെ മുകളിലെ ശരീരവും തുടയും.\n ഈ വ്യായാമം നീട്ടുക.",
  'ex_desc_18': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ ബട്ടിലും കൈകളിലും നേരിട്ട് നിങ്ങളുടെ തോളുകൾക്ക് കീഴിൽ ആരംഭിക്കുക.\n\n\n\nനിങ്ങളുടെ കൈമുട്ട് നിങ്ങളുടെ മുലയൂട്ടുകയും ഒരു പുഷ്-അപ്പ് ചെയ്യുകയും ചെയ്യുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, ആവർത്തിക്കുക.",
  'ex_desc_19': "നിങ്ങളുടെ തോളുകിലും കൈകളിലും നിങ്ങളുടെ തോളുകടിയിൽ നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക",
  'ex_desc_20': "നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ കൈകൾക്കടിയിൽ നിങ്ങളുടെ തോളുകൾക്ക് കീഴിൽ ആരംഭിക്കുക.\n\n നിങ്ങളുടെ ഇടതു കാൽ 90 ഡിഗ്രി ആംഗിളിൽ ഉയർത്തുക.",
  'ex_desc_21': "നിങ്ങളുടെ തലയിൽ നിങ്ങളുടെ വലതു കൈയിൽ കിടക്കുക.\n നിങ്ങളുടെ മുകളിലെ കാൽ കയറി ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\n\nmak വ്യായാമത്തിൽ നിങ്ങളുടെ വലതു കാൽ നേരെ മുകളിലേക്കും താഴേക്കും പോകുന്നു. ഗ്ലൂയൂസിന് ഒരു മികച്ച വ്യായാമം.",
  'ex_desc_22': "നിങ്ങളുടെ തലയിൽ നിങ്ങളുടെ വലതു കൈയിൽ കിടക്കുക.\n നിങ്ങളുടെ മുകളിലെ കാലുകൾ മുകളിലേക്കും ആരംഭിച്ച് ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\n\nmak വ്യായാമ സമയത്ത് നിങ്ങളുടെ ഇടതു കാൽ മുകളിലേക്കും താഴേക്കും പോകുന്നുവെന്ന് ഉറപ്പാക്കുക.\n ഗ്ലൂയൂസിന് ഒരു മികച്ച വ്യായാമം.",
  'ex_desc_23': "നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ ചെവിക്ക് പിന്നിൽ തറയിൽ കിടക്കുക.\n\n\n നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് നിങ്ങളുടെ വലത് കൈമുട്ട് അടയ്ക്കുക, തുടർന്ന് നിങ്ങളുടെ ഇടത് കൈമുട്ട് നിങ്ങളുടെ വലതു കാൽമുട്ടിന് അടയ്ക്കുക.\n വ്യായാമം ചെയ്യുക.",
  'ex_desc_24': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയും നിങ്ങളുടെ കൈകളും നിങ്ങളുടെ കൈകൾ ഉപയോഗിച്ച് നിൽക്കുക.\n\n നിങ്ങളുടെ വലത് കാലിനൊപ്പം ഒരു പടി മുന്നോട്ട് പോയി നിങ്ങളുടെ വലത് തുടയുടെ തറയിൽ മുഴങ്ങുക.\n\n\n the nthen റിട്ടേൺ, മറ്റൊരു കാലിലേക്ക് മാറുക. .\n\n ഈ വ്യായാമം ക്വാഡ്രിസ്പ്സ്, ഗ്ലൂട്ടസ് മാക്സിമസ്, ഹാംസ്ട്രിംഗുകൾ എന്നിവരെ ശക്തിപ്പെടുത്തുന്നു.",
  'ex_desc_25': "നിങ്ങളുടെ കൈകളിൽ നിങ്ങളുടെ കൈകളിലും കാലിലും അടിച്ചതല്ലാതെ നിൽക്കുക.\nt നിങ്ങളുടെ തുടകൾ തറയിൽ സമാന്തരമായി നിങ്ങളുടെ ശരീരം താഴ്ത്തുക.\n\n കാൽവിരൽ നിങ്ങളുടെ ടൈപ്റ്റോസ് എന്ന നിലയിൽ ഒരേ ദിശയിൽ നീട്ടണം.",
  'ex_desc_26': "നിങ്ങളുടെ പാദങ്ങൾ\nfloor- ൽ ഫ്ലാറ്റ് ഉപയോഗിച്ച് കിടക്കുക. നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് നിങ്ങളുടെ വലത് കണങ്കാൽ ഇടുക.\n നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് പുറത്ത്,\nyour ഇടത് വശത്ത് രണ്ട് കൈകളും ഉപയോഗിച്ച് പിടിക്കുക. നിങ്ങളുടെ ശരീരത്തോട് സ ently മ്യമായി\nit വലിക്കുക.",
  'ex_desc_27': "നിങ്ങളുടെ പാദങ്ങൾ\nfloor- ൽ ഫ്ലാറ്റ് ഉപയോഗിച്ച് കിടക്കുക. നിങ്ങളുടെ ഇടത് കണങ്കാൽ നിങ്ങളുടെ വലന്യൂ ഇടുക.\n നിങ്ങളുടെ വലത് കാൽമുട്ടിന് nlift, കൂടാതെ രണ്ട് കൈകളും ഉപയോഗിച്ച് nour വലത് തുടയുടെ പിൻഭാഗം പിടിക്കുക. സ ently മ്യമായി നിങ്ങളുടെ ശരീരത്തിലേക്ക് അത് നവീകരിക്കുക.",
  'ex_desc_28': "പുഷ്-അപ്പ് സ്ഥാനത്ത് ആരംഭിക്കുക.\n\n\n നിങ്ങളുടെ നെഞ്ചിലേക്ക് നിങ്ങളുടെ വലത് കാൽമുട്ട് തുടച്ചുമാറ്റുക, തുടർന്ന് ഒരു കാലിൽ നിന്ന് മറ്റൊന്നിലേക്ക് മാറുക.\n\n ഈ വ്യായാമം ഒന്നിലധികം പേശി ഗ്രൂപ്പുകളെ ശക്തിപ്പെടുത്തുന്നു.",
  'ex_desc_29': "നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ വശങ്ങളിൽ കിടക്കുക.\n\n\n നിങ്ങളുടെ കാലുകൾ, നിങ്ങളുടെ വലത് കാൽ വേഗത്തിൽ ഉയർത്തുക, നിങ്ങളുടെ ഇടത് കാൽ വേഗത്തിൽ ഉയർത്തുക. ആവർത്തിച്ച്.",
  'ex_desc_30': "നിങ്ങളുടെ പാദങ്ങൾ വിശാലമായ ദൂരം, നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ കൈകൾ വിശ്രമിച്ചു.\nt nth നിങ്ങളുടെ ഇടത് കാൽ കുനിഞ്ഞ് ഇടതുവശത്തേക്ക് നിങ്ങളുടെ ശരീരം കുനിഞ്ഞ് നിങ്ങളുടെ ശരീരം കുറച്ച് നിമിഷങ്ങൾക്കുള്ളിൽ ചായുക. വശം.",
  'ex_desc_31': "നേരെ നിൽക്കുക.\n\n നിലത്ത് നിങ്ങളുടെ ഇടത് കാൽ ഉപയോഗിച്ച് വലതുവശത്ത് വലത്തോട്ടും മുട്ടുകുത്തി ഒരേ സമയം വളയ്ക്കുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക് തിരികെ കൊണ്ടുവന്ന് മറുവശത്തേക്ക് മാറുക.",
  'ex_desc_32': "ഉടൻ തന്നെ നിൽക്കുക.\n\n നില നിങ്ങളുടെ വലതു കാൽ പുറകിലേക്ക് ചുവടുവെച്ച് നിങ്ങളുടെ ശരീരം താഴ്ത്തുക. .",
  'ex_desc_33': "നേരെ നിൽക്കുക.\n\n നിലത്ത് നിങ്ങളുടെ ഇടത് കാൽ പിന്നിലേക്ക് ചുവടുവെച്ച് നിങ്ങളുടെ ശരീരം താഴ്ത്തുക.\n\n നിങ്ങൾ വരുന്നത് നിങ്ങൾക്ക് കഴിയുന്നത്ര ഉയരത്തിൽ ഉയർത്തുക. .",
  'ex_desc_34': "നിങ്ങളുടെ വലതു കാൽ ഉപയോഗിച്ച് ഒരു വലിയ പടി മുന്നോട്ട് കൊണ്ടുപോകുക,\nനിങ്ങളുടെ മുകളിലെ ശരീരം നേരെയാക്കുന്നു.\n\n, നിങ്ങളുടെ ശരീരം നേരെ താഴേക്ക് പോയി മുകളിലേക്ക് പോകും.",
  'ex_desc_35': "നിങ്ങളുടെ ഇടത് കാലിനൊപ്പം ഒരു വലിയ പടി മുന്നോട്ട് കൊണ്ടുപോകുക,\nനിങ്ങളുടെ മുകളിലെ ശരീരം നേരെയാക്കുന്നു.\n\n നിങ്ങളുടെ ശരീരം നേരെ താഴേക്ക് പോവുകയും മുകളിലേക്കും പോകുകയും ചെയ്യുക.",
  'ex_desc_36': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് നേരെ നിൽക്കുക.\n\n നിങ്ങളുടെ വലത് കാലിനെ വശത്തേക്ക് നയിക്കുക, തുടർന്ന് നിങ്ങളുടെ ഇടത് കാൽ നേരെ സൂക്ഷിക്കുമ്പോൾ നിങ്ങളുടെ ശരീരം താഴ്ത്തുക.",
  'ex_desc_37': "കിടന്ന് നിങ്ങളുടെ പാദങ്ങൾ തറയിൽ പരന്ന് മുട്ടുകുത്തുക. നിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങളുടെ നെഞ്ചിന് മുന്നിൽ കടക്കുക.\n\n\nth നിങ്ങളുടെ തലയും തോളുകളും നിലത്തേക്ക് ഉയർത്തുക.\n\nity പ്രാഥമികമായി മക്കാദ്ധയായ ആപത്ത് പേശികളിലും ചരിവുകളിലും പ്രവർത്തിക്കുന്നു.",
  'ex_desc_38': "നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ കൈകൾ\nനെഗ്നിലിൻ, നിങ്ങളുടെ വലത് കാൽ ഉയർത്തി നിങ്ങളുടെ വലതു കാൽ വരെ, നിങ്ങളുടെ വലത് കാൽ\nlabout\n\n\n habored. തുടർന്ന് ആരംഭ\nനാമനിർദ്ദേശത്തേക്ക് മടങ്ങുക, മറുവശത്ത് ആവർത്തിക്കുക.",
  'ex_desc_39': "നിങ്ങളുടെ പുറകിൽ കിടന്ന് പിന്തുണയ്ക്കായി നിങ്ങളുടെ ഇടുപ്പിന്റെ ചുവട്ടിൽ കൈ വയ്ക്കുക.\n ഒരു വലത് കോണിൽ തറയിൽ നിന്നാണ് നിങ്ങളുടെ കാലുകൾ ഉയർത്തുക.\n\n നിങ്ങളുടെ കാലുകൾ തിരികെ കൊണ്ടുവന്ന് വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_40': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് നിങ്ങളുടെ പുറകിൽ കിടക്കുക, നിങ്ങളുടെ കൈമുട്ട് നിങ്ങളുടെ തോളുകൾക്ക് കീഴിൽ നേരിട്ട് നിങ്ങളുടെ വടിയിൽ നിങ്ങളുടെ ഇടത് വശത്ത് എത്തിക്കുക.\n\n മുതൽ ആരംഭിക്കുന്നതുവരെ സ്ഥാനം.\n\n പലതവണ NRRepeat, തുടർന്ന് മറുവശത്തേക്ക് മാറുക.",
  'ex_desc_41': "നിങ്ങളുടെ കാൽവിരലുകളും കൈത്തണ്ടയും ഉപയോഗിച്ച് തറയിൽ കിടക്കുക.\n seld, നിങ്ങൾക്ക് കഴിയുന്നിടത്തോളം കാലം ഈ സ്ഥാനം കൈവശം വയ്ക്കുക.",
  'ex_desc_42': "നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ വശങ്ങളിൽ കിടക്കുക,\n ഷീൽഡറുകളിൽ ചെറുതായി ഉയർത്തി.\n നിങ്ങളുടെ കാലുകൾ തറയിൽ നിന്ന് മുട്ടുകുത്തി നിങ്ങളുടെ നെഞ്ചിലേക്ക് വളയുക.\n നിങ്ങളുടെ നെഞ്ചിലേക്ക് വളയുക.",
  'ex_desc_43': "ഓരോ ഘട്ടത്തിലും നിങ്ങളുടെ നിതംബത്തിൽ സ്പർശിക്കാൻ തറയിൽ നിൽക്കുക, തുടർന്ന് നിങ്ങളുടെ കുതികാൽ ചവിട്ടിക്കൊണ്ടിരിക്കുക.\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാൻ.\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാൻ.\net നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാനുള്ള മികച്ച വ്യായാമമാണ്.",
  'ex_desc_44': "നിങ്ങളുടെ ഇടത് കാൽ നിങ്ങളുടെ വലതു കാൽക്ക് പിന്നിൽ കിടക്കുക.\n\n നിങ്ങളുടെ തലയ്ക്ക് പിന്നിൽ നിങ്ങളുടെ തലയ്ക്ക് പിന്നിലും ഇടത് കൈയും നിങ്ങളുടെ പഴയ പേശികളുടെ വലതുവശത്ത് നിങ്ങളുടെ ഇടത് കൈയും.\n നിങ്ങളുടെ ഇടത് വശത്ത് തറയിൽ നിന്ന് മുകളിലേക്ക്.\n\nവ്യായാമം നേടാം.",
  'ex_desc_45': "നിങ്ങളുടെ വലതു കാൽ നിങ്ങളുടെ ഇടത് കാൽക്ക് പിന്നിൽ കിടക്കുക.\n\n നിങ്ങളുടെ തലയ്ക്ക് പിന്നിൽ നിങ്ങളുടെ തലയ്ക്ക് പിന്നിൽ നിങ്ങളുടെ തലയ്ക്ക് പിന്നിലും നിങ്ങളുടെ വലതു കൈ തറയിൽ നിന്ന് വലതു കൈയും.\n\n നിങ്ങളുടെ വലതുവശത്ത് തറയിൽ നിന്ന് പുറത്തേക്ക്.\n\nവ്യായാമം നേടാം.",
  'ex_desc_46': "നിങ്ങളുടെ കാലുകൾ കുനിഞ്ഞ് നിങ്ങളുടെ വശങ്ങളാൽ നിലത്തു കിടക്കുക.\n നിങ്ങളുടെ മുകളിലെ മൃതദേഹം തറയിൽ നിന്ന് ഉയർത്തി നിങ്ങളുടെ കൈകളെല്ലാം നിങ്ങളുടെ കൈകൾ എത്തുക.",
  'ex_desc_47': "മുട്ടുകുത്തി തറയിൽ ഇരിക്കുക, പാദങ്ങൾ അല്പം ഉയർത്തി പിന്നിലേക്ക് പിന്നോട്ട് പോയി.\nനാൽപഥത്തിൽ നിങ്ങളുടെ കാലുകൾ നിങ്ങളുടെ കാൽമുട്ടിന് കീഴിൽ ഉയർത്തുക.",
  'ex_desc_48': "നിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങളുടെ ആയുധങ്ങൾ നീട്ടി\nstairth ഓവർഹെഡ്. എന്നിട്ട് നിങ്ങളുടെ രണ്ട് കൈകളും\nനോഗുകളും തറയിൽ നിന്ന് ഉയർത്തുക.\n\n ഈ സ്ഥാനം രണ്ട് സെക്കൻഡ് നേരത്തേക്ക് നയിക്കുക.\nstart സ്ഥാനത്തേക്ക് മടങ്ങുക, ആവർത്തിക്കുക.",
  'ex_desc_49': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് നിങ്ങളുടെ പിൻഭാഗത്ത് കിടക്കുക\nനിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ കൈകൾ അടിയിൽ നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുന്നതുവരെ നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക. നിങ്ങളുടെ\nവ്യോമങ്ങളെ നേരെയാക്കി നിങ്ങളുടെ ഹിപ്സ് തറയിൽ നിന്ന് ഉയർത്തുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക്\nrenun & വ്യായാമം ആവർത്തിക്കുക.\n",
  'ex_desc_50': "നിങ്ങളുടെ തോളുകിലും കൈകളിലും മുട്ടുകുത്തി നിൽക്കുക.\nthe nth നിങ്ങളുടെ വലതു കാൽ, ഇടത് കൈ എന്നിവ ഒരേ സമയം നീട്ടുക.\n\n ഒരേ സമയം തന്നെ.\n\n ഒരേ സമയം തന്നെ.",
  'ex_desc_51': "നിങ്ങളുടെ മുൻവശത്ത് നിങ്ങളുടെ ഇടതുവശത്ത് കിടക്കുക നിങ്ങളുടെ മുകൾ ഭാഗവും നിങ്ങളുടെ മുകളിലെ ശരീരവും നിങ്ങളുടെ വലതുവശവും നിങ്ങളുടെ മുൻപിൽ നിലത്ത് കിടക്കുന്നു.\n\n നിങ്ങളുടെ മുന്നിൽ. നിങ്ങളുടെ കാലുകൾ ലഘുവായി ഉയർത്തുക\nനാൻ ഒരു നിമിഷം പിടിച്ച്\nstart സ്ഥാനത്തേക്ക് മടങ്ങുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_52': "നിങ്ങളുടെ കൈത്തണ്ട നിങ്ങളുടെ കൈവശമുള്ള നിങ്ങളുടെ വലതുവശത്ത് കിടക്കുക നിങ്ങളുടെ മുകൾ ഭാഗവും നിങ്ങളുടെ ഇടത്\nhand inndround നിങ്ങളുടെ മുൻപിൽ നിലത്തുവീഴുന്നു. നിങ്ങളുടെ കാലുകൾ ലഘുവായി ഉയർത്തുക\nനാൻ ഒരു നിമിഷം പിടിച്ച്\nstart സ്ഥാനത്തേക്ക് മടങ്ങുക. വ്യായാമം ആവർത്തിക്കുക.\n",
  'ex_desc_53': "മുട്ടുകുത്തി തറയിൽ ഇരിക്കുക, അടി അല്പം ഉയർത്തി പിന്നിലേക്ക് പിന്നോട്ട് പോയി.\nTH NTHEN നിങ്ങളുടെ കൈകൾ ഒരുമിച്ച് കൈവശം വയ്ക്കുക.",
  'ex_desc_54': "പതിവ് പുഷ്-അപ്പ് സ്ഥാനത്ത് ആരംഭിക്കുക, എന്നാൽ നിങ്ങളുടെ കൈകൾ ഒരു കസേരയിലോ ബെഞ്ചിലോ ഉയർത്തി.\n നിങ്ങളുടെ കൈകൊണ്ട് നിങ്ങളുടെ ശരീരത്തെ താഴേക്ക് മുക്കുന്നു. നിങ്ങളുടെ ശരീരം നേരെ നിലനിർത്താൻ ഓർമ്മിക്കുക.",
  'ex_desc_55': "നേരെ നിൽക്കുക. തുടർന്ന് നിങ്ങളുടെ ഇടത് കാലിൽ പിന്നോട്ട് പോയി നിങ്ങളുടെ ശരീരം താഴ്ത്തുക. നിങ്ങൾ വരുമ്പോൾ, നിങ്ങളുടെ ഇടത് കാൽ മുകളിലേക്ക് ചവിട്ടുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_56': "നേരെ നിൽക്കുക. തുടർന്ന് നിങ്ങളുടെ വലതു കാൽ ഉപയോഗിച്ച് പുറകിൽ ചുവടുവെക്കുക, നിങ്ങളുടെ ശരീരം താഴ്ത്തുക. നിങ്ങൾ മുകളിലേക്ക് വരുമ്പോൾ, നിങ്ങളുടെ വലതു കാൽ മുകളിലേക്ക് ചവിട്ടുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_57': "ആരംഭ സ്ഥാനത്തിനായി, കസേരയിൽ ഇരിക്കുക. കസേരയുടെ കൈകൾ കൈകൊണ്ട് ചലിപ്പിച്ച്\n കസേരയിൽ നിന്ന് അകറ്റുക.\n\n\n, നിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങളുടെ ആയുധങ്ങൾ മുകളിലേക്കും താഴേക്കും.\n ട്രൈസെപ്സിനുള്ള മികച്ച വ്യായാമമാണിത്.",
  'ex_desc_58': "തോളിയേക്കാൾ അല്പം വീതിയുള്ളത്, കൈമുട്ട് വളച്ച്, ഓരോരുത്തരും അഭിമുഖീകരിക്കുന്ന ഈന്തപ്പന, നിങ്ങളുടെ ശരീരം പരിധിയിലേക്ക് വിരൽ ചൂണ്ടുന്നു. നിങ്ങൾ എഴുന്നേൽക്കുമ്പോൾ, നിങ്ങളുടെ ശരീരം to ഇടതുവശത്തേക്ക് തിരിക്കുക, വലതു കാൽ വയ്ക്കുക, വലത് കൈ നീട്ടുക വശം.",
  'ex_desc_59': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക, നിങ്ങളുടെ കൈകൾ മുന്നോട്ട് നീട്ടി.\n\n\n നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ തറയിൽ നിന്ന് ഉയർത്തുക.\n\n ചരിഞ്ഞത്.",
  'ex_desc_60': "നിങ്ങളുടെ തല വിശ്രമിക്കുന്ന നിങ്ങളുടെ ഇടത് വശത്ത് കിടക്കുക\nനിങ്ങളുടെ ഇടത് കൈയും കാലുകളും നീട്ടി.\n\n nlift നിങ്ങളുടെ മുൻപിൽ നിങ്ങളുടെ വലത് കാൽമുട്ട് വളയ്ക്കുക,\nനിങ്ങളുടെ കാല് തിരികെ. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_61': "നിങ്ങളുടെ തല വിശ്രമിക്കുന്നതിലൂടെ നിങ്ങളുടെ വലതുവശത്ത് കിടക്കുക\nനിങ്ങളുടെ വലതു കൈയും കാലുകളും നീട്ടി.\n\n nlift നിങ്ങളുടെ മുൻപിൽ നിങ്ങളുടെ മുന്നിൽ കുനിഞ്ഞ് വളയ്ക്കുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_62': "നിങ്ങളുടെ വയറ്റിൽ കിടന്ന് കൈമുട്ട് നിങ്ങളുടെ ചുമലിൽ കുനിഞ്ഞ് വളയ്ക്കുക.\n നിങ്ങളുടെ നെഞ്ചിനെ കഴിയുന്നിടത്തോളം നിലത്തുനിന്ന് നിലത്തേക്ക് നീക്കുന്നു.",
  'ex_desc_63': "നിങ്ങളുടെ പാദങ്ങളിൽ തോളിനൊപ്പം വീതിയും വേർപെടുത്തുക. ബാലൻസ് നിലനിർത്താൻ നിങ്ങളുടെ മുന്നിൽ വളയുക\n ആയുധങ്ങൾ.\n നിങ്ങളുടെ ശരീരത്തെ\nനൊമെൽ ഉപയോഗിച്ച് സമാന്തരമാകുന്നതുവരെ നിങ്ങളുടെ ശരീരം. എല്ലാ യും വരുന്നതിനുപകരം പകുതി വഴി വരൂ, തുടർന്ന് വീണ്ടും ചൂഷണം ചെയ്യുക. ആവർത്തിച്ച്.",
  'ex_desc_64': "നിങ്ങളുടെ വലത് കാലിനൊപ്പം വലതുവശത്ത് പരന്നുകിടക്കുക, നിങ്ങളുടെ ഇടത് കാൽ വളഞ്ഞ\nour നിങ്ങളുടെ വലതു കാൽ വലത്തോട്ടിട്ടുള്ളത്.\n നിങ്ങളുടെ വലതു കാൽ അവകാശം നിൽക്കുകയും\nനെയ്ക്ക് തുടകൾ മുതൽ\nനൊര് തുട വരെ, അത് പതുക്കെ അത് കുറയ്ക്കുക\n.",
  'ex_desc_65': "നിങ്ങളുടെ ഇടത് കാലിനൊപ്പം നിങ്ങളുടെ പുറകിൽ പരന്നുകിടക്കുക, നിലത്ത് വലതുഭാഗവും വലതു കാൽ വളഞ്ഞ\nwith നിങ്ങളുടെ വലത് കാൽ നിലത്തു നിലത്ത്.\n നിങ്ങളുടെ ഇടത് കാൽ പരന്നുകിടക്കുന്നു. അത് പതുക്കെ അത് കുറയ്ക്കുക\n.",
  'ex_desc_66': "പാദങ്ങളുടെ തോളിൻറെ വീതിയും വേർതിരിക്കുക. നിങ്ങളുടെ\nbalance നിലനിർത്താൻ നിങ്ങളുടെ നെഞ്ചിന് മുന്നിൽ\nOUR ആയുധങ്ങൾ ഇടുക.\n\nthen ഒരു സ്ക്വാറ്റ് ചെയ്യുക, നിങ്ങൾ മുകളിലേക്ക് വരുമ്പോൾ, നിങ്ങളുടെ ഇടത് കാൽ വശത്തേക്ക് വലിക്കുക.\nexecise ആവർത്തിച്ച് വലത് കാലിലേക്ക് മാറുക.\n\ninhale നിങ്ങൾ താഴേക്ക് പോകുമ്പോൾ, നിങ്ങൾ എപ്പോൾ\nyou എഴുന്നേൽക്കുമ്പോൾ ശ്വസിക്കുക. നിങ്ങളുടെ കാൽമുട്ടുകൾ നിങ്ങളുടെ കാൽമുട്ടുകൾ ഉപയോഗിച്ച് വ്യാപിപ്പിക്കണം.\n\nit ക്വാഡ്രിസ്പ്സിനും\ngnluteus maximus നും ഒരു മികച്ച വ്യായാമമാണ്.",
  'ex_desc_67': "നിങ്ങളുടെ പുറകിൽ ആയുധങ്ങൾ, പാംസ്\nit ന്റെ ഒരു മികച്ച വ്യായാമമാണ്,\nractus asemominis.",
  'ex_desc_68': "നിങ്ങളുടെ മുട്ടുകുത്തി തറയിൽ കിടക്കുക, കാൽ തറയിൽ പരന്നുകിടക്കുക.\n ഒരു കാൽ മുകളിലേക്ക് ഉയർത്തുക. നിങ്ങൾക്ക് കഴിയുന്നത്ര ഉയർന്ന നിലവാരത്തിലേക്ക് ഉയർത്തുക. വശം.",
  'ex_desc_69': "നിങ്ങളുടെ മുട്ടുകുത്തി തറയിൽ കിടക്കുക, കാൽ തറയിൽ പരന്നുകിടക്കുക.\n ഒരു കാൽ മുകളിലേക്ക് ഉയർത്തുക. നിങ്ങൾക്ക് കഴിയുന്നത്ര ഉയർന്ന നിലവാരത്തിലേക്ക് ഉയർത്തുക. വശം.",
  'ex_desc_70': "നിങ്ങളുടെ കൈകളുള്ള നിങ്ങളുടെ കൈകളുള്ള ഒരു നേരായ ഭുജം പ്ലാങ്ക് സ്ഥാനത്ത് ആരംഭിക്കുക.\n\n നിങ്ങളുടെ കൈകാലുകൾ ഒരേ സമയം ഇടതുവശത്ത് നൊക്ക് ചെയ്യുക. ഇടതുവശത്ത് കുറച്ച് ഘട്ടങ്ങൾ എടുക്കുക, തുടർന്ന് വലത്തേക്ക് കുറച്ച് ഘട്ടങ്ങൾ. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_71': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയിൽ ആരംഭിക്കുക.\n\nനിങ്ങളുടെ ശരീരം നിങ്ങൾക്ക് മുന്നിൽ നടന്ന് നിങ്ങളുടെ മുൻപിൽ നടക്കുക, തുടർന്ന് നിങ്ങളുടെ കൈകൾ തിരികെ നടക്കുക.",
  'ex_desc_72': "നിങ്ങളുടെ പാദങ്ങളിൽ നിന്ന് ആരംഭിക്കുക.\nനിങ്ങളുടെ കാലുകൾ ചെറുതായി നയിക്കുക, നിങ്ങളുടെ മുകൾഭാഗം മുന്നേറുക.\nbalance നിലനിർത്താൻ നിങ്ങളുടെ മുന്നിൽ നിങ്ങളുടെ മുന്നിൽ, തുടർന്ന് വേഗത്തിൽ ഓടുക.",
  'ex_desc_73': "നിങ്ങളുടെ കൈകളിലൂടെ ഒരു സ്ക്വാറ്റ് സ്ഥാനത്ത് ആരംഭിക്കുക.\n\njump അൺ, നിങ്ങളുടെ കാലുകൾ പരത്തുക, നിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങളുടെ വശങ്ങളിലേക്ക് ഉയർത്തുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, അടുത്ത പ്രതിനിധി ചെയ്യുക.",
  'ex_desc_74': "തണ്ടും ഉപയോഗിച്ച് ആരംഭിക്കുക.\n ഒരു കാൽമുട്ടിനെയും എതിർവശത്തെ കൈമുട്ടിനെയും പരസ്പരം സ്പർശിക്കാൻ എതിർവശത്ത് തിരികെ കൊണ്ടുവരിക.\n\nRRepet മറുവശത്ത്.",
  'ex_desc_75': "നിങ്ങളുടെ തോളുകൾക്കും കാലുകൾക്കും കീഴിലുള്ള നേരായ ഭുജത്തിന്റെ പലക സ്ഥാനത്ത് ആരംഭിക്കുക\nലീമേർ.\n നിങ്ങളുടെ കാലുകൾ വേർപെടുത്തുക,\nthen ഹോപ്പ് ബാക്ക്. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_76': "നിങ്ങളുടെ പാദങ്ങൾ തോളിനൊപ്പം നിൽക്കുക, എന്നിട്ട് നിങ്ങളുടെ കൈകൾ നിലത്ത് വയ്ക്കുക, നിങ്ങളുടെ കാലുകൾ പിന്നോട്ട് അടിക്കുക.\n\n ഒരു ദ്രുത പുഷ്-അപ്പ് പിന്നീട് കുതിക്കുക.",
  'ex_desc_77': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയും അരക്കെട്ടും നിലകൊള്ളുക.\n നിങ്ങളുടെ വലതു കാൽ ഉപയോഗിച്ച് ഒരു വലിയ പിന്നോട്ട്, നിങ്ങളുടെ ഇടത് തുട തറയ്ക്ക് സമാന്തരമായി നിങ്ങളുടെ ശരീരം താഴ്ത്തുക.",
  'ex_desc_78': "പ്ലാങ്ക് സ്ഥാനത്ത് ആരംഭിക്കുക. നിങ്ങളുടെ ശരീരം\nback കൂടാതെ പുറത്തുകടക്കുക.",
  'ex_desc_79': "തറയിൽ നിൽക്കുക, നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ മുന്നിൽ വയ്ക്കുക, വശത്ത് നിന്ന് ഒരു ഹോപ്പ് ചെയ്യുക.",
  'ex_desc_80': "നിങ്ങളുടെ പാദങ്ങളിൽ നിന്ന് ആരംഭിച്ച് നിങ്ങളുടെ തലയ്ക്ക് മുകളിൽ stried.\n\n gump അൺ, നിങ്ങളുടെ കാലുകൾ പരത്തുക, നിങ്ങളുടെ കാലുകൾ പരത്തുകയും ചൂഷണം ചെയ്യുകയും ചെയ്യുക.",
  'ex_desc_81': "നിങ്ങളുടെ കൈകളിൽ നിന്ന് നിങ്ങളുടെ ചുമലിൽ നിന്ന് ആരംഭിക്കുക, നിങ്ങളുടെ ഇടത് കാൽ കുനിഞ്ഞ് നിങ്ങളുടെ ഇടത് കൈയുടെ പുറത്തേക്ക് അടുത്തും വലതു കാൽ നിങ്ങളുടെ പിന്നിൽ നീട്ടി. തുടർന്ന് കാലുകൾ വായുവിൽ ചാടുക.",
  'ex_desc_82': "നിങ്ങളുടെ വശങ്ങളിൽ കൈകോർന്ന് ഓരോ കൈയിലും കൈകൊണ്ട് കൈകൊണ്ട് കൈവശം വയ്ക്കുക.\n\njump, മാറിമാറി നിങ്ങളുടെ കൈത്തണ്ടയിൽ നിങ്ങൾ ഒരു കയർ കറങ്ങുകയും ചെയ്യുന്നു.",
  'ex_desc_83': "സ്ക്വാറ്റ് സ്ഥാനത്ത് ആരംഭിക്കുക, തുടർന്ന് നിങ്ങളുടെ വയറുവേദന ഉപയോഗിച്ച് വീണ്ടും ചാടുക.\n\n ഈ വ്യായാമം നിങ്ങളുടെ അടിവയറ്റുകുട്ടകൾ പ്രവർത്തിക്കുന്നു.",
  'ex_desc_84': "ആയുധങ്ങൾ പിന്തുണയ്ക്കുന്ന\nനെയോർഡി ഉപയോഗിച്ച് നിലത്തു വയ്ക്കുക. പ്രതീക്ഷിക്കുക, നിങ്ങളുടെ കാൽമുട്ടുകൾ കൊണ്ടുവരിക\nനോട്ടൗണ്ട് നിങ്ങളുടെ നെഞ്ച് കൊണ്ടുവരിക, തുടർന്ന് ആരംഭത്തിലേക്ക് മടങ്ങുക\nനാമവിശേഷണം. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_85': "നേരായ കൈപ്പൽ സ്ഥാനത്ത് നിന്ന് ആരംഭിക്കുക.\nനിങ്ങളുടെ വലതു കൈ കുനിഞ്ഞ് നിങ്ങളുടെ കൈമുട്ടിനെ കുത്തുക, തുടർന്ന് നിങ്ങളുടെ കൈമുട്ട് നിങ്ങളുടെ കൈമുട്ട് സ്ഥാപിക്കുക, തുടർന്ന് പരമ്പരാഗത പലക സ്ഥാനത്തേക്ക് വളയുക. ആരംഭത്തിലേക്ക് മടങ്ങുക\nനാമവിശേഷണം. വ്യായാമം ആവർത്തിക്കുക.\n\n\n നിങ്ങളുടെ ശരീരത്തെ നേരിട്ട് വരുമ്പോൾ, നിങ്ങൾ ഇറങ്ങുമ്പോൾ നിങ്ങൾ ഇറങ്ങുമ്പോൾ,\nyou nyout\n\nye വരാം, ട്രൈസ്പ്സ്\nനാൻഡിലെ വയറുവേദനയ്ക്ക്.",
  'ex_desc_86': "നിങ്ങളുടെ ഇടത് കാൽ നിലത്തും വലത്തു കാലിലും നേരെ നിൽക്കുക, നിങ്ങളുടെ വലതുവശത്ത് ഉയർത്തി.\n\n ഒരു ചെറിയ കുതിച്ചുചാട്ടം, നിങ്ങളുടെ ഇടത് വശത്തേക്ക് സ്വിംഗ് ചെയ്യുക. കാലുകൾ വേഗത്തിൽ സ്വിച്ച് ആവർത്തിക്കുക.",
  'ex_desc_87': "പതിവ് പുഷ്-അപ്പ് സ്ഥാനത്ത് ആരംഭിക്കുക, തുടർന്ന് നിങ്ങളുടെ\nnke ഫ്ലോത്ത് സ്പർശിച്ച് നിങ്ങളുടെ പാദങ്ങൾ\n\nnext നിങ്ങളുടെ ശരീരത്തെ മുകളിലേക്കും താഴേക്കും ഉയർത്തുന്നു.",
  'ex_desc_88': "ഓരോ ഘട്ടത്തിലും നിങ്ങളുടെ മുട്ടുകൾ കഴിയുന്നത്ര ഉയരത്തിൽ വലിച്ചെടുക്കുമ്പോൾ സ്ഥലത്ത് ഓടുക.\n\n നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ ഈ വ്യായാമത്തിൽ നിവർന്നുനിൽക്കുന്നു.",
