  'ex_desc_100': "നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ കൈകളോടൊപ്പം നിൽക്കുക അല്ലെങ്കിൽ നിങ്ങളുടെ ചുമലിൽ ഇരിക്കുക.\nനിങ്ങളുടെ ചെവിയിൽ നിങ്ങൾ റോൾ ചെയ്യുക,\nഇല്ലെൻ അവയെ തിരികെ ഉരുട്ടുന്നു, പിന്നെ ചൂഷണം ചെയ്യുക, പിന്നെ റോൾ\nthem. വ്യായാമം ആവർത്തിക്കുക.",
