  'ex_desc_114': "ഒരു കസേരയുടെ അരികിൽ ഇരിക്കുക, നിങ്ങളുടെ വലതു കാൽ നിങ്ങളുടെ കുതികാൽ നിലത്ത് നീട്ടുക, കാൽവിരൽ ചൂണ്ടിക്കാണിക്കുന്നു.\n\n നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ കാൽവിരലുകളിലേക്ക് നീച്ചു. ഈ സ്ഥാനം കുറച്ച് നിമിഷങ്ങൾ കൈവശം വയ്ക്കുക.",
