  'ex_desc_122': "നിങ്ങളുടെ ഇടതുവശത്ത് കിടക്കുക\nour\nouar your home, കാൽമുട്ട് എന്നിവയിൽ വിശ്രമിക്കുന്ന നിങ്ങളുടെ ഇടതുവശത്ത് കിടക്കുക.\n\nheels സ്പർശിക്കുമ്പോൾ നിങ്ങളുടെ വലത് കാൽമുട്ട് മുകളിലേക്ക് വയ്ക്കുക, തുടർന്ന് ആരംഭത്തിലേക്ക് മടങ്ങുക\nനാമനിർദ്ദേശം ചെയ്യുക. വ്യായാമം ആവർത്തിക്കുക.",
