  'ex_desc_125': "നിങ്ങളുടെ ഇടതുവശത്ത് നിങ്ങളുടെ ഇടത് വശത്ത് കിടക്കുക.\n\n നിലത്ത് തറയിൽ നിങ്ങളുടെ വലതു കാൽ മുന്നോട്ട് വയ്ക്കുക.\n നിങ്ങളുടെ വലതു കാൽ തറയിൽ വയ്ക്കുക.\n നിങ്ങളുടെ വലതു കാൽ തറയിൽ വയ്ക്കുക.\n\n നിങ്ങളുടെ ഇടത് കാൽ മുകളിലേക്കും താഴേക്കും.",
