  'ex_desc_129': "നിങ്ങളുടെ പുറകുവശത്ത് നേരെ നിലനിർത്തുമ്പോൾ തറയിൽ കിടക്കുക, നിങ്ങളുടെ മുകൾഭാഗം തറയിൽ നിന്ന് ഉയർത്തുക.\n\n നിങ്ങൾക്ക് കഴിയുന്നിടത്തോളം കാലം NOTOLDED.\n ബ്രിഡ്ജ് വ്യായാമം.",
  'ex_desc_130': "നിങ്ങളുടെ പാദങ്ങൾ തറയിൽ പരന്നുകിടക്കുക. നിങ്ങളുടെ വലത് കണങ്കാൽ നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് പുറത്ത് ഇടുക, നിങ്ങളുടെ ചെവിക്ക് പിന്നിൽ ഇടത് കൈ തറയിലെ വശത്തേക്ക് വ്യാപിപ്പിക്കുക.\n നിങ്ങളുടെ തോളുകൾ തറയിൽ നിന്ന് വയ്ക്കുക. നിങ്ങളുടെ വലതുവശത്ത് നിന്ന് നിങ്ങളുടെ വലതു കൈമുട്ട്, വലത് കൈ അടുക്കുക നിങ്ങളുടെ ശരീരം, പതുക്കെ മടങ്ങുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_131': "നിങ്ങളുടെ പാദങ്ങൾ തറയിൽ പരന്നുകിടക്കുക. നിങ്ങളുടെ ഇടത് കണങ്കാൽ നിങ്ങളുടെ വലതു കൈയ്യിൽ, നിങ്ങളുടെ ചെവിക്ക് പിന്നിൽ വലതു കൈ ഇടുക, ഇടത് കൈ തറയിലെ വശത്തേക്ക് വ്യാപിപ്പിക്കുക.\n നിങ്ങളുടെ തോളുകൾ തറയിൽ നിന്ന് വയ്ക്കുക. നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് പുറത്ത് നിൽക്കുക, ഇടത് കൈ അടുത്ത് കൊണ്ടുവരിക നിങ്ങളുടെ ശരീരം, പതുക്കെ മടങ്ങുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_132': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് നിങ്ങളുടെ വയറ്റിൽ കിടക്കുക, നിങ്ങളുടെ ചിൻ നിങ്ങളുടെ കൈകളിൽ നിങ്ങളുടെ ചിൻ ചെയ്യുക.\n\n നിങ്ങളുടെ കാലുകൾ തറയിൽ നിന്ന് പുറത്തുകടക്കുക, തുടർന്ന് നിങ്ങളുടെ ഇടത്തോട്ടും വലത്തോട്ടും മുകളിലേക്ക് ഉയർത്തുക.",
  'ex_desc_133': "തറയിൽ ഇരിക്കുക, 45 ഡിഗ്രി ആംഗിൽ നിങ്ങളുടെ കാലുകൾ ഉയർത്തുക, നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ 45 ഡിഗ്രി കോണിൽ ചായുക.\n\n ആയുധങ്ങൾ മുന്നോട്ട്.\n നിങ്ങളുടെ ആയുധങ്ങൾ മുന്നോട്ട്.",
  'ex_desc_134': "നിങ്ങളുടെ കാൽമുട്ടുകൾ വളച്ച് നിങ്ങളുടെ വയറ്റിൽ കിടക്കുക,\nhelels ഒരുമിച്ച് ഞെക്കി.\nT NTHEN നിങ്ങളുടെ പാദങ്ങൾ മുകളിലേക്കും താഴേക്കും ഉയർത്തുക. നിങ്ങളുടെ നിതംബം ഞെരുക്കുന്നതിൽ പതിവ് ഫലപ്രദമാണ് വ്യായാമം.",
  'ex_desc_135': "മുട്ടുകുത്തി നിൽക്കുക, മുട്ടുകുത്തി, നിലത്ത് പരന്നതും നിങ്ങളുടെ ഇടുപ്പിന് താഴെയുള്ളതുമായ കൈകൾ.\n\nടാബ് സ്പോംബോപ്പ് സ്ഥാനത്തേക്ക് നിങ്ങളുടെ കാലുകൾ എൻആർഎഎ; നിങ്ങളുടെ ഇടത് കാൽ നിലത്തേക്ക് ഇടുക. നിങ്ങളുടെ കാൽവിരലുകളുമായി നിലം ടാപ്പുചെയ്യുക; തുടർന്ന് കാല് തിരികെ ഉയർത്തുക. വശങ്ങൾ മാറുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_136': "നിങ്ങളുടെ കൈകൾ പൂർണ്ണമായും വിപുലീകരിക്കുകയും നിങ്ങളുടെ പെരുവിരൽ ചൂണ്ടിക്കാണിക്കുകയും ചെയ്യുക, നിങ്ങളുടെ ശരീരം നിങ്ങളുടെ ആയുധങ്ങൾ\"y\" എന്ന നിലയിൽ ആയിരിക്കണം. 2 സെക്കൻഡ് മുകളിൽ. പതുക്കെ ആരംഭ സ്ഥാനം തിരികെ പോയി വ്യായാമം ആവർത്തിക്കുക.\n",
  'ex_desc_137': "നിങ്ങളുടെ കാൽക്കൊപ്പം തറയിൽ ഇരിക്കുക, നിങ്ങളുടെ കാൽവിരലുകൾ.\n\nനിങ്ങളുടെ കാൽമുട്ടുകൾ വശങ്ങളിലേക്ക് നോപെഡും നിങ്ങളുടെ\nknebs അമർത്തിപ്പിക്കുക. ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_138': "നിങ്ങളുടെ കാലുകൾക്കൊപ്പം നിങ്ങളുടെ പുറകിൽ കിടക്കുക.\n\n\nനിങ്ങളുടെ കാൽമുട്ടുകൾ നട്ടുവളർത്തി\nനെ നെഞ്ചിലേക്ക് കൊണ്ടുവരിക; രണ്ട്\nhands ഉപയോഗിച്ച് കാൽമുട്ടുകൾ കെട്ടിപ്പിടിക്കുക. കുറച്ച് നിമിഷങ്ങൾ കൈവശം വയ്ക്കുക.",
  'ex_desc_139': "നിങ്ങളുടെ മുട്ടുകുത്തി നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക.\n\nനിങ്ങളുടെ ആയുധങ്ങൾ വശങ്ങളിലേക്ക് പിന്നോട്ട് നയിക്കുകയും നിങ്ങളുടെ\n\n\n നിങ്ങളുടെ കാലുകൾ നിലത്തു ഇട്ടു.\n നിങ്ങളുടെ കാലുകൾ നിലത്തു ഇടും. സ്ഥലവും നിങ്ങളുടെ കാൽമുട്ടും കാലും\n ഒരു സെക്കൻഡിൽ ഇത് നതാകമാക്കി, തുടർന്ന് മറുവശത്ത്\nthe nthe ആയി. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_140': "ഒരു സ്റ്റാൻഡേർഡ് പ്ലാങ്ക് സ്ഥാനത്ത് നിന്ന് ആരംഭിക്കുക. നിങ്ങളുടെ നട്ടെല്ല് നിങ്ങളുടെ ഇടത് വശത്തേക്ക് നിങ്ങളുടെ ഇടത് വശത്തേക്ക് നിങ്ങളുടെ ഇടതുവശത്ത് നിങ്ങളുടെ ഇടതുവശത്ത് നിങ്ങളുടെ ഇടതുവശത്ത്, തുടർന്ന്\nനോട്ടർ ഭാഗത്തേക്ക് വളച്ചൊടിക്കുക.\n\n വ്യായാമം ചെയ്യുക.",
  'ex_desc_141': "നിങ്ങളുടെ കൈകളിലും കാലുകളിലും നീട്ടി നിങ്ങളുടെ കൈകൊണ്ട് കിടക്കുക.\n\n\n നിങ്ങളുടെ കാലുകളും ആയുധങ്ങളും തറയിൽ നിന്ന് ആയുധങ്ങൾ. നിങ്ങളുടെ മുകളിലെ ശരീരം ഉയർത്തി നിങ്ങളുടെ വയറുവേദനയ്ക്ക് നിങ്ങളുടെ ആയുധങ്ങളും കാൽമുട്ടുകളും ചൂഷണം ചെയ്യുക.\n\n നിങ്ങളുടെ ആയുധങ്ങളും കാലുകളും നിങ്ങളുടെ ആയുധങ്ങളും കാലുകളും (പക്ഷേ തറയിൽ തൊടരുത്), വ്യായാമം ആവർത്തിക്കരുത്.",
  'ex_desc_142': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ കൈകളിലൂടെ നിങ്ങളുടെ കൈകൾ നേരിട്ട് നിങ്ങളുടെ കൈകൾ നേരിട്ട് ആരംഭിക്കുക നിങ്ങളുടെ വലത് കാൽ പിന്നിലേക്ക് വയ്ക്കുക. ഇത് വീണ്ടും ഉയർത്തുക, അത് താഴ്ത്തുക\nstrairt താഴേക്ക്.\n Nplay നിങ്ങളുടെ വലത് കാൽ\nfloor ലേക്ക് ബന്ധിപ്പിക്കരുത്. ഘട്ടങ്ങൾ ആവർത്തിക്കുക.",
  'ex_desc_143': "നിങ്ങളുടെ\n ഷീൾഡറുകൾക്ക് കീഴിലുള്ള നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ കൈകൾ നേരിട്ട് നിങ്ങളുടെ കൈകൾ നേരിട്ട് ആരംഭിക്കുക.\n നിങ്ങളുടെ ഇടത് കാൽ പിന്നോക്കം നിൽക്കുക, എന്നിട്ട് നിങ്ങളുടെ വലതുവശത്ത് മാത്രം താഴ്ത്തുക. ഇത് വീണ്ടും ഉയർത്തുക, അത് താഴ്ത്തുക\nstraidne താഴേക്ക്.\n\nplay നിങ്ങളുടെ ഇടത് കാൽ തറയിൽ തൊടാൻ അനുവദിക്കരുത്.\nഘട്ടങ്ങൾ നിരക്കുക.",
  'ex_desc_145': "തോളിൽ ഉയരത്തിൽ നിങ്ങളുടെ കൈത്തണ്ടകൾ ഒരുമിച്ച് പിടിക്കുക.",
  'ex_desc_146': "നിങ്ങളുടെ കാലുകൾ നേരെ, നിങ്ങളുടെ ആയുധങ്ങൾ നേരെയാക്കി നിങ്ങളുടെ കൈകൾ ഉയർത്തി, ഓവർഹെഡ് വിപുലീകരിച്ചു. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, ആവർത്തിക്കുക.",
  'ex_desc_147': "നിങ്ങളുടെ പാദങ്ങളിൽ തോളിനൊപ്പം വീതിയും വേർപെടുത്തുക. ഓരോ കൈയിലും ഒരു ഡംബെൽ പിടിക്കുക.\n\n നിങ്ങളുടെ ഇടത് കൈയും നിങ്ങളുടെ വലതുവശത്ത് നിങ്ങളുടെ വലതു കൈയും ഉപയോഗിച്ച് എൻആർഎയാക്കും.\n\n ആരംഭിക്കുന്ന സ്ഥാനത്തേക്ക്.",
  'ex_desc_148': "നിങ്ങളുടെ പാദങ്ങളിൽ തോളിനൊപ്പം വീതിയും വേർപെടുത്തുക. മുന്നോട്ട് ചായുക, മുട്ടുകുത്തി ചെറുതായി കുനിഞ്ഞ് നിങ്ങളുടെ അരക്കെട്ടിലേക്ക് ഇരിക്കുക. ഓരോ കൈയിലും ഒരു ഡംബെൽ പിടിക്കുക.\n\n\nനിങ്ങളുടെ കൈമുട്ട് നീട്ടുക, അവയെ പിന്നോട്ട് വലിക്കുക. നിങ്ങളുടെ കൈകൾ താഴ്ത്തി വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_149': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക, നിങ്ങളുടെ പാദങ്ങൾ തറയിൽ പരന്നുകിടക്കുക.\n\n ഓരോ കൈയിലും ഒരു ഡംബെൽ, നിങ്ങളുടെ കൈവശമുള്ള നിങ്ങളുടെ കൈകൾ ഉയർത്തുക, നിങ്ങളുടെ കൈമുട്ട് ചെറുതായി വളയ്ക്കുക.\n\nlower നിങ്ങളുടെ മുകളിലെ ആയുധങ്ങൾ തറയിൽ സ്പർശിക്കുന്നതുവരെ വശങ്ങളിലേക്ക് ഡംബെൽ ചെയ്യുന്നു. മടങ്ങിവന്ന് വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_150': "നിങ്ങളുടെ കാലുകൾ ഉയർത്തി, കാൽമുട്ടുകൾ വളയുക, കുതികാൽ എന്നിവരെ നിങ്ങളുടെ വശങ്ങളിൽ ഞെക്കിപ്പിടിച്ചു.\n\n നിങ്ങളുടെ വശങ്ങളിൽ പരന്നതാണ്.\n നിങ്ങളുടെ ആയുധങ്ങൾ പരേജയാകും, നിങ്ങളുടെ കാലുകൾ ആരംഭിക്കുക.\n\nനിങ്ങളുടെ കാലുകളിലേക്ക് അവരെ തിരികെ കൊണ്ടുവരിക.",
  'ex_desc_151': "നിങ്ങളുടെ കൈകളിലേക്ക് നിങ്ങളുടെ പുറകിൽ കിടക്കുക. നിങ്ങളുടെ കാലുകൾ ഉയർത്തുക, നിങ്ങൾക്ക് കഴിയുന്നത്ര എൻസ്ട്രായിറ്റ് ആയി സൂക്ഷിക്കുക.\n\n നിങ്ങളുടെ കാലുകൾക്ക് nsreade, പിന്നീട് അവരെ തിരികെ കൊണ്ടുവരിക.",
  'ex_desc_152': "നിങ്ങളുടെ കാലുകൾ വളച്ച് ഉയർത്തി നിങ്ങളുടെ പുറകിൽ കിടക്കുക. നിങ്ങളുടെ കാലുകളുമായി നിരവധി തവണ സൈക്ലിംഗ് പ്രവർത്തനം നടത്തുക, തുടർന്ന് അത് മാറ്റുക.",
  'ex_desc_153': "നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ ചുമലിൽ നിന്ന് ആരംഭിക്കുക, നിങ്ങളുടെ വലതു കാൽമുട്ട് നിങ്ങളുടെ നിതംബത്തിനടിയിലും ഇടത്തുത്തീരത്തും നീട്ടി നിലത്ത് വയ്ക്കുന്നു.\n നിങ്ങളുടെ ഇടത് വശത്തേക്ക് നിങ്ങളുടെ ഇടത് വശത്തേക്ക് nlift. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_154': "നിങ്ങളുടെ ചുമലിൽ നിങ്ങളുടെ കൈകളിൽ നിന്ന് ആരംഭിക്കുക, നിങ്ങളുടെ നിതംബത്തിനടിയിൽ നേരിട്ട് നിങ്ങളുടെ വലതു കാൽ നീട്ടി നിലത്ത് വയ്ക്കുക.\n നിങ്ങളുടെ വലതു കാൽ നിങ്ങളുടെ വലതുവശത്തേക്ക്. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_155': "നിങ്ങളുടെ ശരീരത്തിലുടനീളം ഒരു ഭുജം വയ്ക്കുക, നിലത്തു സമാന്തരമായി ചെയ്യുക, തുടർന്ന് നിങ്ങളുടെ നെഞ്ചിലേക്ക് നിങ്ങളുടെ നെഞ്ചിലേക്ക് വലിക്കുക, തുടർന്ന് നിങ്ങളുടെ നെഞ്ചിലേക്ക് വലിച്ചിടാൻ, കുറച്ച് സമയത്തേക്ക്, വൈകുന്നേരം വ്യായാമം.",
  'ex_desc_156': "നിങ്ങളുടെ വലതു കൈകൊണ്ട് നിൽക്കുക.\n\n നിങ്ങളുടെ ഇടത് കാലിനെ നിങ്ങളുടെ ഇടത് തുടയിലേക്ക് കൊണ്ടുവരാൻ നിങ്ങളുടെ കണങ്കാലോ കാൽവിരലുകളോ ഗ്രഹിക്കുക.\n\n ഈ സ്ഥാനം.",
  'ex_desc_157': "ചുമരിൽ ഇടത് കൈകൊണ്ട് നിൽക്കുക. വളയുക\nyour വലത് കാൽ, നിങ്ങളുടെ കണങ്കാൽ അല്ലെങ്കിൽ കാൽവിരലുകൾ മനസ്സിലാക്കുക\nനിങ്ങളുടെ വലത് കാളക്കുട്ടിയെ നിങ്ങളുടെ വലതുവശത്തേക്ക് കൊണ്ടുവരിക. ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_158': "ഒരു മതിലിനു മുന്നിൽ ഒരു വലിയ ചുവടുവെക്കുക.\n നിങ്ങളുടെ ഇടത് കാൽ ഉപയോഗിച്ച് മുന്നോട്ട് പോയി, നിങ്ങളുടെ വലതു കാൽ പൂർണ്ണമായും വിപുലീകരിക്കുകയും നിങ്ങളുടെ വലത് കാളക്കുട്ടിയെ അറിയിക്കുകയും ചെയ്യും.\n\nഈ സ്ഥാനം കുറച്ച് നിമിഷങ്ങൾക്കായി നയിക്കുക.",
  'ex_desc_159': "ഒരു മതിലിന് മുന്നിൽ ഒരു വലിയ ചുവടുവെക്കുക.\n നിങ്ങളുടെ വലതു കാൽ ഉപയോഗിച്ച് മുന്നോട്ട് പോയി, നിങ്ങളുടെ ഇടത് കാൽ പൂർണ്ണമായും വിപുലീകരിക്കുന്നുവെന്ന് ഉറപ്പാക്കുക.\n\nഈ സ്ഥാനം കുറച്ച് നിമിഷങ്ങൾക്കായി നയിക്കുക.",
  'ex_desc_160': "നിങ്ങളുടെ കാൽമുട്ടുകളും കൈയും ഉപയോഗിച്ച് ആരംഭിക്കുക.\n\n ഒരു ചെറിയ മുന്നോട്ട്, നിങ്ങളുടെ കാൽമുട്ടുകൾ ചേർത്ത് നിങ്ങളുടെ കാൽവിരലുകൾ ഒരുമിച്ച് ഇടുക. നിങ്ങളുടെ കുതികാൽ തൊടുക.\n\n\nraelax നിങ്ങളുടെ കൈമുട്ട് തറയിൽ തൊടുക, നിങ്ങളുടെ നെഞ്ച് തറയിൽ നിന്ന് താഴെയിറക്കാൻ ശ്രമിക്കുക.\n നിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങൾ ഇരിക്കുമ്പോൾ നിങ്ങളുടെ ആയുധങ്ങൾ മുന്നോട്ട് നീട്ടി.\n നിങ്ങളുടെ തോളും ചെവിയും തമ്മിൽ മതിയായ ഇടമുണ്ടെന്ന് ഉറപ്പാണ് വ്യായാമത്തിൽ.",
  'ex_desc_161': "നിങ്ങളുടെ പാദങ്ങളുമായി ഒരുമിച്ച് തറയിൽ കിടക്കുക.\n\n കാൽമുട്ടുകൾ വശങ്ങളിലേക്ക് നോപ്പ.\n\n ഈ സ്ഥാനം Noldold.",
