  'ex_desc_165': "ഒരു കസേരയുടെ മുന്നിൽ നിൽക്കുക. തുടർന്ന്\nacher ന് മുകളിലേക്ക് പടിപടിയായി പിന്നോട്ട് പോകുക.\n\n കാലുകളും\nbuttockocks ശക്തിപ്പെടുത്തുന്നതിന് വ്യായാമം പ്രവർത്തിക്കുന്നു.",
  'ex_desc_166': "ഒരു ബെഞ്ചിൽ ഇരിക്കുക, നിങ്ങളുടെ കൈകൾ പിടിക്കുക, നിങ്ങളുടെ ശരീരം പിടിക്കുക, നിങ്ങളുടെ ശരീരം ചായുക.\n നിങ്ങളുടെ കാലുകൾ നട്ടുപിടിപ്പിക്കുക, നിങ്ങളുടെ നെഞ്ചിലേക്ക് വളയുക. പൂർണ്ണമായും വിപുലീകരിക്കുക\n കാലുകൾ ആവർത്തിക്കുക.",
  'ex_desc_167': "ഒരു വാതിൽപ്പടി കണ്ടെത്തുക, നിങ്ങളുടെ കൈകൾ വാതിൽ തുറന്ന് നിങ്ങളുടെ കൈകൾ ഉപയോഗിച്ച് നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ\n ഷീൾഡറുകളേക്കാൾ അൽപ്പം നേടുക, എന്നിട്ട് നിങ്ങളുടെ നെഞ്ച്\n നെ നെഞ്ച്\n\n haplood. അപ്പോൾ\ns lowly അതിൽ നിന്ന് പുറത്തുവന്ന് നിങ്ങളുടെ ആയുധങ്ങൾ കൊണ്ടുവന്ന് കുറച്ച് തോളിൽ റോളുകൾ ചെയ്യുക.\n\n നിങ്ങളുടെ തല മുന്നോട്ട് വയ്ക്കരുത്, നിങ്ങളുടെ\nnect ശൂന്യമായി വലിക്കുക.",
