  'ex_desc_186': "നിങ്ങളുടെ തല വിശ്രമിക്കുക\nനിങ്ങളുടെ വലതു കൈ, നിങ്ങളുടെ വലതു കൈ നോൺ.\n നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ ഇടത് കാൽ നിങ്ങളുടെ ഇടത് കാൽ, അത് നേരെ\nup നും താഴും ഉയർത്തുക.",
  'ex_desc_187': "മതിലിന്റെ അടിയിൽ ഒരു തലയിണ ഇടുക. നുണ പറയുക\nനിങ്ങളുടെ പുറം ഉയർത്തി നിങ്ങളുടെ കാലുകൾ\nwall ലേക്ക് ഉയർത്തുക.\nW നിങ്ങളുടെ ഇടുപ്പ് തലയിണയിലേക്ക് വയ്ക്കുക. ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_188': "തറയിൽ നിൽക്കുക, തുടർന്ന് നിങ്ങളുടെ ഇടത് കാൽ വളയ്ക്കുക the നിങ്ങളുടെ ഇടത് തുടയിലേക്ക് അടുത്ത് നിങ്ങളുടെ ഇടത് തുടയിലേക്ക് അടുത്ത് കൊണ്ടുവരാൻ നിങ്ങളുടെ കണങ്കാൽ അല്ലെങ്കിൽ കാൽവിരലുകൾ മനസ്സിലാക്കുക. നെയ്വർ ലിറ്റഡ് ചെയ്ത കാൽമുട്ട് എല്ലായ്പ്പോഴും നേരെ പോകണം, നിങ്ങളുടെ മുകൾ ശരീരം വ്യായാമ സമയത്ത് nstraid സൂക്ഷിക്കണം.",
  'ex_desc_190': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് തറയിൽ കിടക്കുക.\n നിങ്ങളുടെ വലത് കാൽമുട്ടിന് മുകളിലേക്ക് ഉയർത്തി ഇരു കൈകൊണ്ട് പിടിക്കുക. നിങ്ങളുടെ ഇടത് കാൽ നേരെ നിലത്ത് തുടരുമ്പോൾ നിങ്ങളുടെ വലതു കാൽമുട്ടിന് നിങ്ങളുടെ വലത് കാൽമുട്ട്.\n\nഈ സ്ഥാനം കുറച്ച് നിമിഷങ്ങൾക്കായി നയിക്കുക.",
  'ex_desc_191': "നിങ്ങളുടെ കാലുകൾ ഉപയോഗിച്ച് തറയിൽ കിടക്കുക.\n നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് മുകളിലേക്ക് കയറി അതിനെ രണ്ടു കൈകൊണ്ട് പിടിക്കുക. നിങ്ങളുടെ വലതു കാൽ നേരെ നിലത്ത് തുടരുമ്പോൾ നിങ്ങളുടെ ഇടത് കാൽമുട്ട് നിങ്ങളുടെ നെഞ്ചിലേക്ക്.\n\nഈ സ്ഥാനം കുറച്ച് നിമിഷങ്ങൾക്കായി നയിക്കുക.",
  'ex_desc_192': "നിങ്ങളുടെ ഇടത് കാൽമുട്ടിലും കൈകളിലും ആരംഭിക്കുക, നിങ്ങളുടെ കൈകൾ നേരിട്ട് നിങ്ങളുടെ കൈകൾ വയ്ക്കുക.\nTH നിങ്ങളുടെ വലതു കാൽ തിരികെ ഇമാറ്റത്തെ അടിക്കുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക\nനാന്ധൻ വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_193': "നിങ്ങളുടെ വലത് കാൽമുട്ടിലും കൈകളിലും ആരംഭിക്കുക, നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ\n ഷീൾഡറുകൾക്ക് കീഴിൽ നേരിട്ട് ഇടുക.\n നിലത്ത്\n നിലത്താകുന്നതുവരെ നിങ്ങളുടെ ഇടത് കാൽ തിരികെ വയ്ക്കുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക,\nവ്യായാമം ഇല്ലാതാക്കുക.",
  'ex_desc_194': "Sit with your legs extended in front of you.\nBend your left leg with your left foot close\nto your right thigh.\n\nLean your upper body forward. ഈ\nനോപോസിഷൻ പിടിക്കുക.",
  'ex_desc_195': "നിങ്ങളുടെ മുന്നിൽ നീട്ടിയ കാലുകളുമായി ഇരിക്കുക.\nനിങ്ങളുടെ വലത് കാൽ നിങ്ങളുടെ വലത് കാൽ\nനിങ്ങളുടെ ഇടത് തുടയിലേക്ക് nlose. ഈ\nനോപോസിഷൻ പിടിക്കുക.",
  'ex_desc_196': "നിങ്ങളുടെ പാദങ്ങളുമായി ഒരുമിച്ച് തറയിൽ നിൽക്കുക.\n നിങ്ങളുടെ ശരീരം വളച്ച് നിങ്ങളുടെ കാലുകൾക്ക് അടുത്തുള്ള നിങ്ങളുടെ കാലുകൾക്ക് അടുത്ത് കൊണ്ടുവരിക.\n\n നിങ്ങളുടെ കാലുകൾക്ക് അടുത്ത് കൊണ്ടുവരിക.\nr\nrpold കുറച്ച് സെക്കൻഡ്,\nrpet.\n\n നിങ്ങൾ എഴുന്നേൽക്കുമ്പോൾ നിങ്ങളുടെ ശരീരവും\nനിൻഹാലും വളയുന്നു. വ്യായാമ സമയത്ത് നിങ്ങളുടെ കാലുകൾ\nstraid സൂക്ഷിക്കുക.",
  'ex_desc_197': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക\nyour ബട്ടും ബട്ടിലും കൈകളിലും നേരിട്ട് ആരംഭിക്കുക\n തോളുകൾക്ക് കീഴിൽ നേരിട്ട് നിങ്ങളുടെ കൈകൾ നേരിട്ട്.\n നിങ്ങളുടെ കാലുകൾ വരെ നിങ്ങളുടെ അരക്കെട്ട്\nനാൻ തലകീഴായി 'v' ആകൃതിയിൽ ഉയർത്തുക. നിങ്ങളുടെ പാദങ്ങൾ പരത്തുക, നിങ്ങളുടെ വിരലുകൾ വിരിക്കുക.\nOURE ഭാരം നിങ്ങളുടെ കാലുകൾക്ക് തിരികെ കൈമാറുക. ഈ\nനോപോസിഷൻ പിടിക്കുക.",
  'ex_desc_198': "നിങ്ങളുടെ\n ഷീൾഡറുകൾക്ക് കീഴിലുള്ള നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ വലത് കാൽമുട്ടിന് കീഴിൽ നിങ്ങളുടെ കൈകളിലൂടെ ആരംഭിക്കുക.\n നിങ്ങളുടെ വലത് കാൽമുട്ടിന് കീഴിൽ നിൽക്കുക, നിങ്ങളുടെ ഇടത്\nhand ൻഹാൻഡിനും ഇടത് കാൽമുട്ട് ഇടത് കാൽമുട്ട് ഇടുക, നിങ്ങളുടെ വലത് കാൽമുട്ട് ഇടുക\nനിലത്തു നിങ്ങളുടെ വലത് കൈത്തണ്ടയിലേക്ക്.\n\n നിങ്ങളുടെ ഇടത് കാൽ പിന്നിലേക്ക് പിന്നോട്ട്. നിങ്ങളുടെ\nനോഗിന് മുന്നിൽ നിങ്ങളുടെ\n- നെവർ നിങ്ങളുടെ വിരലുകളും ഈന്തപ്പനകളും പരസ്പരം ബന്ധിപ്പിക്കുകയും പരസ്പരം ബന്ധിപ്പിക്കുകയും ചെയ്യുക. കുറച്ച് നിമിഷങ്ങൾ കൈവശം വയ്ക്കുക.",
  'ex_desc_199': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക നിങ്ങളുടെ മുട്ടുകുത്തി, നിങ്ങളുടെ കൈകൾ, നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് കീഴിൽ നിങ്ങളുടെ കൈകൾ ആരംഭിക്കുക, നിങ്ങളുടെ ഇടത് കാൽമുട്ടിന് കീഴിൽ നിങ്ങളുടെ വലത്\nhand, വലത് കാൽമുട്ട്, നിങ്ങളുടെ ഇടത് കാൽമുട്ട് ഇടുക\nനിലത്തുവീഴുള്ള നിങ്ങളുടെ ഇടത് കൈത്തണ്ടയിലേക്ക്.\n\n നിങ്ങളുടെ വലത് കാൽ പിന്നിലേക്ക്. നിങ്ങളുടെ\nനോഗിന് മുന്നിൽ നിങ്ങളുടെ\n- നെവർ നിങ്ങളുടെ വിരലുകളും ഈന്തപ്പനകളും പരസ്പരം ബന്ധിപ്പിക്കുകയും പരസ്പരം ബന്ധിപ്പിക്കുകയും ചെയ്യുക. കുറച്ച് നിമിഷങ്ങൾ കൈവശം വയ്ക്കുക.",
  'ex_desc_200': "നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ കൈകളുമായി നിൽക്കുക. നിങ്ങളുടെ വലത് കാലിനു പിന്നിൽ കുരിശിലൂടെ\n ലെഗ് നിങ്ങളുടെ തലയ്ക്ക് മുകളിലൂടെ കൈകാലുകൾ പിന്നോട്ട് നയിക്കുന്നു. നിങ്ങളുടെ മുകളിലെ ശരീരം നിങ്ങളുടെ വലതുവശത്തേക്ക് വളയ്ക്കുക.\nകുറച്ച് നിമിഷങ്ങൾക്കുള്ള നവീകരണം.",
  'ex_desc_201': "നിങ്ങളുടെ വശങ്ങളിൽ നിങ്ങളുടെ കൈകളുമായി നിൽക്കുക. നിങ്ങളുടെ ഇടത് കാലിനു പിന്നിൽ ക്രോസ്\nyour വലത് കാലിന് പിന്നിൽ.\n\nനിങ്ങളുടെ തലയ്ക്ക് മുകളിലൂടെ കൈകാലുകൾ പിന്നോട്ട് നയിക്കുന്നു, നിങ്ങളുടെ ഇടത് കൈകൊണ്ട് നിങ്ങളുടെ the nrite കൈകൊണ്ട് മനസിലാക്കി നിങ്ങളുടെ the നിങ്ങളുടെ ഇടത് കൈകൊണ്ട് മനസ്സിലാക്കി നിങ്ങളുടെ\nltft വശത്തേക്ക് വലിച്ചിടുക. നിങ്ങളുടെ മുകളിലെ ശരീരം നിങ്ങളുടെ ഇടതുവശത്തേക്ക് വളയ്ക്കുക.\nകുറച്ച് നിമിഷങ്ങൾക്കുള്ള നവീകരണം.",
  'ex_desc_202': "കാൽനടയാത്രക്കാരായ ഒരു ചുവരുപയോഗിച്ച് ഒരു ചുവരുപയോഗിച്ച് നിൽക്കുക, മതിൽ അതിനെതിരായ നിങ്ങളുടെ ഇടുപ്പ്.\n മതിൽ.\n\n മതിൽ വരെ നിങ്ങളുടെ മുട്ടുകുത്തി.\nexecise ആവർത്തിക്കുക.",
  'ex_desc_203': "നിങ്ങളുടെ പുറകിലുള്ള ഒരു കസേരയിൽ ഇരിക്കുക. പതുക്കെ\nനിങ്ങളുടെ വലത് കാൽ നേരെ, അത് നിലത്തു നപര്യൾലിനെ സമീപിച്ച്, അത് പതുക്കെ താഴ്ത്തുക.",
  'ex_desc_204': "നിങ്ങളുടെ പുറകിലുള്ള ഒരു കസേരയിൽ ഇരിക്കുക. പതുക്കെ നിങ്ങളുടെ ഇടത് കാൽ നേരെയും\nനിലത്തു നപര്യലർട്ടല്ലും വരെ പിന്നോട്ട് നയിക്കുന്നു, തുടർന്ന് അത് പതുക്കെ താഴ്ത്തുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_205': "പിന്തുണയ്ക്കായി നിങ്ങളുടെ കൈകൊണ്ട് നിങ്ങളുടെ വലതുവശത്ത് കിടക്കുക.\n, നിങ്ങളുടെ the nrith തുടയുടെ ലാറ്ററൽ ഭാഗത്ത് ഒരു നുരയെ റോളർ, നിങ്ങളുടെ ഇടത് കാൽ\nfloor- ൽ മുന്നോട്ട് വയ്ക്കുക. നിങ്ങളുടെ മുട്ടുകുത്തി നിങ്ങളുടെ ഹിപ്\nൽ നിന്ന് തുടയും പുറത്തും ഉരുട്ടുക.",
  'ex_desc_206': "പിന്തുണയ്ക്കായി നിങ്ങളുടെ കൈകളിലൂടെ നിങ്ങളുടെ ഇടതുവശത്ത് കിടക്കുക.\n\n n\n n stast site ലെറ്റർ തുടയിൽ\n നിങ്ങളുടെ ഇടത് തുടയിൽ നിന്ന് നിങ്ങളുടെ വലതു കാൽ to വേർതിരിച്ച് തറയിൽ ഇടുക. നിങ്ങളുടെ ഹിപ് മുതൽ കാൽമുട്ട് വരെ തുടയിലേക്ക് പുറപ്പെടുവിച്ച്\n.",
  'ex_desc_207': "കൈത്തണ്ടയിൽ\nഎൻഎസ്പിപോർട്ടിംഗ് ഉപയോഗിച്ച് നിലത്തു വയ്ക്കുക.\n നിങ്ങളുടെ തുടയിൽ ഒരു നുരയെ റോളറെ നിങ്ങളുടെ തുടയിൽ നിന്ന് നിങ്ങളുടെ\nfeet ലയിപ്പിക്കുക. നിങ്ങളുടെ കാൽമുട്ടിലേക്ക് അങ്ങോട്ടും ഇങ്ങോട്ടും താഴേക്ക് കുത്തനെ റോൾ ചെയ്യുക.",
  'ex_desc_208': "നിങ്ങളുടെ കാലുകൾ മുന്നിൽ നീട്ടി നിങ്ങളുടെ കാലുകളിൽ നീട്ടി. നിങ്ങളുടെ തുടയിൽ ഒരു നുരയുടെ റോളർ വയ്ക്കുക, പിന്തുണയ്ക്കായി തറയിൽ നിങ്ങളുടെ കൈകൾ വയ്ക്കുക.\n\n നിങ്ങളുടെ പാദങ്ങൾ നിലത്തുനിന്ന് നിങ്ങളുടെ അരയിൽ നിന്ന് ഉരുട്ടി നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക.",
  'ex_desc_209': "നിങ്ങളുടെ കാലുകൾ മുന്നിൽ നീട്ടി നിങ്ങളുടെ കാലുകളിൽ നീട്ടി. നിങ്ങളുടെ കാൽമുട്ടിന് കീഴിൽ ഒരു നുരയുടെ റോളർ സ്ഥാപിക്കുക,\nഎൻഎസ്പിപ്പോർട്ടിനായി നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ പിന്നിൽ കൈകൾ നിർത്തി. അത് പതുക്കെ താഴ്ത്തുക. വ്യായാമം the വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_210': "നിങ്ങളുടെ കാലുകൾ മുന്നിൽ നീട്ടി നിങ്ങളുടെ കാലുകളിൽ നീട്ടി. നിങ്ങളുടെ കാൽമുട്ടിന് കീഴിൽ ഒരു നുരയെ വയ്ക്കുക,\nഎൻഎസ്പിപ്പോർട്ടിനായി നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ പിന്നിൽ കൈ വയ്ക്കുക.\n നിങ്ങളുടെ ഇടത് കാൽ ഉയർത്തി നിങ്ങളുടെ കാലിനെ നിങ്ങൾക്ക് കഴിയുന്നത്ര നേരെയാക്കുക. അത് പതുക്കെ താഴ്ത്തുക. വ്യായാമം the വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_211': "നിങ്ങളുടെ മുട്ടുകുത്തി നിൽക്കുക, നിലത്ത് വളയ്ക്കുക\nflat.\n\n നിങ്ങളുടെ താഴത്തെ പിന്നിലേക്ക് നിലത്തുവീഴുന്നു. നിങ്ങളുടെ താഴത്തെ ബാക്ക്,\nനിലകൾ തമ്മിലുള്ള വിടവ്\nനെലിംഗ് ചെയ്യുക, തുടർന്ന് ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\n\nവ്യായാമം ചെയ്യുക.",
  'ex_desc_212': "പതുക്കെ നടക്കുക. നിങ്ങളുടെ കുതികാൽ നിലത്ത് വയ്ക്കുക, കാൽനടയായി നിങ്ങളുടെ കാൽവിരലുകളിലൂടെ വയ്ക്കുക, തുടർന്ന് നിങ്ങളുടെ കാൽവിരലുകൾ ഉപയോഗിച്ച് മുന്നോട്ട് പോവുക.",
  'ex_desc_213': "ഒരു മതിലിനു നേരെ ആയുധങ്ങളുമായി നിൽക്കുക. നിങ്ങളുടെ ഇടത് കണങ്കാലിൽ നിങ്ങളുടെ വലത്\nfoot ഇടുക, തുടർന്ന് നിങ്ങളുടെ ഇടത് കുതികാൽ ഉയർത്തുക\nനാന്ധൻ താഴേക്ക് ഉയർത്തുക.",
  'ex_desc_214': "ഒരു മതിലിനു നേരെ ആയുധങ്ങളുമായി നിൽക്കുക. നിങ്ങളുടെ ഇടത് കാൽ\nനിങ്ങളുടെ വലത് കണങ്കാലില്ല, തുടർന്ന് നിങ്ങളുടെ വലത് കുതികാൽ മുകളിലേക്കും\nവലുതാക്കും.",
  'ex_desc_215': "പുഷ്-അപ്പ് സ്ഥാനത്ത് ആരംഭിക്കുക, എന്നാൽ നിങ്ങളുടെ\nനാർമുകൾ നേരെയാക്കുക. ഈ വ്യായാമം\nyour abeaden and ബാക്ക് പേശികളുമാണ്.",
  'ex_desc_216': "നിങ്ങളുടെ ഇടതുവശത്ത് കിടക്കുക. നിങ്ങളുടെ ഇടത് കൈമുട്ട് നിങ്ങളുടെ ചുമലിൽ നിൽക്കുക, നിങ്ങളുടെ അരയിൽ നിങ്ങളുടെ the നാടൻ കൈ ഇടുക. നിങ്ങളുടെ വലത് കാൽ വയ്ക്കുക\nനിങ്ങളുടെ ഇടത് കാൽ നോക്കുക.\n\nseconds അമർത്തിപ്പിടിക്കുക, തുടർന്ന് ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\nനെ ഈ വ്യായാമം ചെയ്യുക.",
  'ex_desc_217': "നിങ്ങളുടെ വലതുവശത്ത് കിടക്കുക. നിങ്ങളുടെ വലത് കൈമുട്ട് നിങ്ങളുടെ തോളിന് കീഴിൽ ഇട്ടു നിങ്ങളുടെ അരയിൽ നിങ്ങളുടെ\nkeft കൈ ഇടുക. നിങ്ങളുടെ ഇടത് കാൽ വയ്ക്കുക\nനിങ്ങളുടെ വലത് കാലിനല്ല.\n\nceconds അമർത്തിപ്പിടിക്കുക, തുടർന്ന് ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\nനെ ഈ വ്യായാമം ചെയ്യുക.",
  'ex_desc_218': "ഒരു പരമ്പരാഗത പ്ലാങ്ക് സ്ഥാനത്ത് ആരംഭിക്കുക, തുടർന്ന് ഒരു ഭുജം മുന്നോട്ട് നീട്ടുക.\n\n നിങ്ങളുടെ ശരീരം നേരിട്ട് നിങ്ങളുടെ ശരീരം നേരെയാക്കുന്നു.\n\nm nmuscl\nmuscl, deltodeode പേശികൾക്ക് ഒരു മികച്ച വ്യായാമമാണ്.",
  'ex_desc_219': "വലതുവശത്ത് ആരംഭിക്കുക, തുടർന്ന്\nyour മുകളിലെ കാൽ ഉയർത്തി മുന്നോട്ട് പോകുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\n\n നിങ്ങളുടെ ഇടുപ്പ് സ്വാധീനിക്കരുത്, നിങ്ങളുടെ കാലുകൾ,\nupper by എന്നിവ നേരെ നിലനിർത്തുക. n\nit ഗ്ലൂടസിന്,\nനക്രാഡ്രിസ്പ്സ് എന്നിവയ്ക്കുള്ള മികച്ച വ്യായാമമാണ്.",
  'ex_desc_220': "ഇടത് വശത്ത് പ്ലാങ്ക് സ്ഥാനത്ത് ആരംഭിക്കുക, തുടർന്ന്\nyour മുകളിലെ കാൽ ഉയർത്തി മുന്നോട്ട് പോകുക. ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.\n\n നിങ്ങളുടെ ഇടുപ്പ് സ്വാധീനിക്കരുത്, നിങ്ങളുടെ കാലുകൾ,\nupper by എന്നിവ നേരെ നിലനിർത്തുക. n\nit ഗ്ലൂടസിന്,\nനക്രാഡ്രിസ്പ്സ് എന്നിവയ്ക്കുള്ള മികച്ച വ്യായാമമാണ്.",
  'ex_desc_221': "നിങ്ങളുടെ കാലുകളുള്ള തറയിൽ ഇരിക്കുക, ഹിപ്സ് അപ്പ് നിങ്ങളുടെ\n ഷീൾഡറുകൾക്ക് കീഴിൽ മുന്നോട്ട് പോയിന്റുചെയ്യുന്നു.\n നിങ്ങളുടെ കാലുകളെ വായുവിലൂടെ ഇതര ഇടത്, netight എന്നിവയിൽ നിങ്ങളുടെ പാദങ്ങൾ.",
  'ex_desc_222': "നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ ചെവിക്ക് പിന്നിൽ കിടക്കുക.\n\n നിങ്ങളുടെ മുകളിലെ ശരീരത്തെ തറയിൽ നിന്ന് ഉയർത്തുക, സാവധാനം ഇരിപ്പിടത്തേക്ക്. നിങ്ങൾ എഴുന്നേൽക്കുമ്പോൾ കഴുത്ത് വലിച്ചെറിയരുത്.\n\n stoly stost ലേക്ക് തിരികെ പോയി വ്യായാമം ആവർത്തിക്കുക.\n\n\n spene വേദനിപ്പിക്കുന്നു, ദയവായി മറ്റൊരു വ്യായാമത്തിലേക്ക് മാറ്റുക.",
  'ex_desc_223': "നിങ്ങളുടെ കൈകളിലും കാലിലും നേരെ നിങ്ങളുടെ കൈകൊണ്ട് നേരെ സീലിംഗിലേക്ക് നേരെയാക്കുക.\n\n u ഹിപ്സ് നേരെ തറയിലേക്ക് നേരെയാക്കുക, തുടർന്ന് ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക.",
  'ex_desc_224': "നിങ്ങളുടെ പാദങ്ങൾ തോളിൽ വീതിയും വേർപിരിയുക.\n\n നിലത്ത് കൈകൊണ്ട് വലയ്ക്കുകയും നിങ്ങളുടെ കാലുകൾ പിന്നിലേക്ക് ചവിട്ടുകയും ചെയ്യുക. നിങ്ങളുടെ വലത് കാൽമുട്ട് നിങ്ങളുടെ നെഞ്ചിലേക്ക് വളച്ച് നിങ്ങളുടെ ഇടത് കാൽ നേരെ സൂക്ഷിക്കുക, തുടർന്ന് നിങ്ങളുടെ ഇടത് കാലിലേക്ക് മാറുക.\n നിങ്ങളുടെ ഇടത് കാൽ പിന്നിലേക്ക് പിന്നോട്ട് പോകുക. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_225': "നിങ്ങളുടെ കാൽമുട്ടുകൾ കുനിഞ്ഞ സ്ഥാനത്ത് നിന്ന് ആരംഭിക്കുക.\n\n നിങ്ങളുടെ ചെവിയുടെ പിന്നിൽ കൈകൾ. നിങ്ങളുടെ മുകളിലെ മൃതദേഹം ഒരു വശത്തേക്ക് വളച്ചൊടിക്കുക.\n\n\n ആരംഭ സ്ഥാനത്തേക്ക് തിരികെ താഴ്ത്തുക. മറുവശത്ത് ആവർത്തിക്കുക.",
  'ex_desc_226': "നിങ്ങളുടെ കാലുകൾ നിങ്ങളുടെ പിന്നിൽ കിടക്കുക. നിങ്ങൾ അത് ഉയർത്തുമ്പോൾ, നിങ്ങളുടെ ഹിപ്സ് തറയിൽ നിന്ന് ഉയർത്തുക.\n\n ആരംഭ സ്ഥാനത്തേക്ക്. മറ്റ് കാലിലേക്ക് മാറുക, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_227': "നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ മുമ്പിൽ ഇരിക്കുക.\n\nനിങ്ങളുടെ കാലുകൾ നേരെയുമുള്ള, അത് നിലത്തുനിന്ന് ഉയർത്തുക. സർക്കിളുകളിൽ നിങ്ങളുടെ കാലുകൾ എതിർ ഘടികാരദിശയിൽ നീക്കുക.",
  'ex_desc_228': "നിങ്ങളുടെ കൈകൾ തോളിൽ ഉയരത്തിലെ വശങ്ങളിലേക്ക് നീട്ടി.\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാൻ.\n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാനുള്ളത്. ഡെൽറ്റോയിഡ് പേശി.",
  'ex_desc_229': "നിങ്ങളുടെ കൈവശമുള്ള നിങ്ങളുടെ കൈവശമുള്ള നിങ്ങളുടെ കൈവശമുള്ളത് നിങ്ങളുടെ ശരീരത്തെയും കാൽമുട്ടിനെയും തറയിൽ വളയുന്നു.\n\n നിങ്ങളുടെ നട്ടെല്ല് നേരെയുള്ള നിങ്ങളുടെ നട്ടെല്ല് നേരെയാക്കുന്നു. ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_230': "നിങ്ങളുടെ കൈവശമുള്ള നിങ്ങളുടെ കൈത്തണ്ടയിൽ കിടക്കുക നിങ്ങളുടെ ശരീരത്തെ പിന്തുണയ്ക്കുന്നു.\n നിങ്ങളുടെ നട്ടെല്ല് നേരെയുള്ള നിങ്ങളുടെ നട്ടെല്ല് നേരെയാക്കുന്നു. ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_231': "നിങ്ങളുടെ ആയുധങ്ങൾ തോളിൽ ഉയരത്തിൽ വലതുവശത്ത് നിൽക്കുക.\n\n sight sight സർക്കിളുകളിൽ നിങ്ങളുടെ ആയുധ ക counter ണ്ടർക്ലോക്ക് വൈൽഡ്\nmve\nm n\n നിങ്ങൾക്ക് കഴിയുന്നത്ര വേഗത്തിൽ ചെയ്യാനുള്ളത്. ഡെൽറ്റോയ്ഡ് പേശിക്ക്.",
  'ex_desc_232': "മുട്ടുകുത്തി മുട്ടുകുത്തി കുനിഞ്ഞ് നിങ്ങളുടെ കൈമുട്ട് വളയ്ക്കുക.\n\nനിങ്ങളുടെ ആയുധങ്ങൾ നിങ്ങളുടെ പിന്നിൽ കൈകൾ പിന്നോട്ട് പോയി നിങ്ങളുടെ\ntriceps പിഴിഞ്ഞെടുക്കുന്നു. നിങ്ങളുടെ കൈകൾ വ്യാപിപ്പിക്കുമ്പോൾ നിങ്ങളുടെ കൈകൾ സമാന്തരമായി ചെയ്യുക.\n\n ആ ആരംഭ സ്ഥാനത്തേക്ക് മടങ്ങുക, ഇത് ആവർത്തിക്കുക. Nexercise ആവർത്തിക്കുക.",
  'ex_desc_233': "നിങ്ങളുടെ കാലുകൾ കുനിഞ്ഞ്, നിങ്ങളുടെ കൈകൾ\nshoulder-വീതി നിങ്ങൾക്ക് പുറത്ത് വയ്ക്കുക,\nനിങ്ങളുടെ വിരലുകൾ വശത്തേക്ക് അഭിമുഖീകരിക്കുന്നുവെന്ന് ഉറപ്പാക്കുക.\n നിങ്ങളുടെ മുകളിലെ ശരീരം അമ്പരപ്പിക്കുന്നതുവരെ നിങ്ങളുടെ കൈകളും\nfeet ഉപയോഗിച്ച്.",
  'ex_desc_234': "നിങ്ങളുടെ പാദങ്ങളുമായി വിച്ഛേദിക്കണം.\n\n\n said നിങ്ങളുടെ കൈകൾ തോളിൽ ഉയരത്തിൽ തോളിൽ ഉയരത്തിൽ മറ്റേ ഭുജം മറ്റേ കൈയെത്തി\"x\" എന്ന അക്ഷരത്തിൽ\n\n\n ആയുധങ്ങൾ, വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_235': "സ്ട്രെയിറ്റ് അഡ്വാൻ പ്ലാങ്ക് സ്ഥാനത്ത് നിന്ന് ആരംഭിക്കുക. നിങ്ങളുടെ ഇടത് തോളിൽ ടാപ്പുചെയ്യാൻ നിങ്ങളുടെ വലതു കൈ നിൽക്കുക.\n\n ആരംഭിക്കുക ആരംഭ സ്ഥാനത്തേക്ക്\nthe nthe nthe nthe nthe ഉപയോഗിച്ച് ആവർത്തിക്കുക.",
  'ex_desc_236': "നിങ്ങളുടെ വലതു കൈയ്ക്കൊപ്പം ഒരു മതിലിനടുത്ത് നിൽക്കുക.\nനിങ്ങളുടെ വലതു കൈ പിന്നോട്ട് ചെയ്ത് നിങ്ങളുടെ വലതുവശത്ത്\nhand വീട്ടിൽ ഇടുക, തുടർന്ന് നിങ്ങളുടെ ശരീരം the to.",
  'ex_desc_237': "നിങ്ങളുടെ ഇടത് കൈകൊണ്ട് ഒരു മതിലിനടുത്ത് നിൽക്കുക.\nനിങ്ങളുടെ ഇടത് കൈ അടുത്തറിയുകയും ഇടത് കൈകൊണ്ട്\nമതിൽ ഇട്ടത്, തുടർന്ന് നിങ്ങളുടെ ശരീരം\nആയി തിരിയുക.",
  'ex_desc_238': "നിങ്ങളുടെ പാദങ്ങൾ തോളിലേക്ക് വീതിയിൽ തറയിൽ നിൽക്കുക. നിങ്ങളുടെ കൈപ്പത്തിയിൽ നിങ്ങളുടെ കൈകൾ അഭിമുഖീകരിക്കുന്ന തോളിൽ ഉയരത്തിൽ നിങ്ങളുടെ കൈകൾ മുന്നോട്ട് നീട്ടുക.\n\nനിങ്ങളുടെ ആയുധങ്ങൾ കഴിയുന്നത്ര അടുത്തേക്ക് അടുക്കുന്നു. വ്യായാമം ആവർത്തിക്കുക.",
  'ex_desc_239': "നിങ്ങളുടെ കൈകൾ ഒരുമിച്ച് പിടിച്ച്\nthe ntheth ഓവർഹെഡ് ഉയർത്തുക. വലിയ സർക്കിളുകളിൽ നിങ്ങളുടെ ആയുധങ്ങൾ\ncountercoucksise നീക്കുക.",
  'ex_desc_240': "നിങ്ങളുടെ കൈകൾ ചേർത്ത്\nനോവർഹെഡ് ഉയർത്തുക. നിങ്ങളുടെ ആയുധങ്ങൾ ഘടികാരദിശയിൽ നീക്കുക\nin വലിയ സർക്കിളുകൾ.",
  'ex_desc_241': "മതിൽ നിങ്ങളുടെ കൈകൊണ്ട് മതിലിന് മുന്നിൽ നിൽക്കുക. നിങ്ങളുടെ മുകൾ ഭാഗത്തേക്ക് തിരിഞ്ഞ് സ്ലൈഡ്\n കൈകൾ താഴേയ്ക്ക് നിങ്ങളുടെ കൈകൾ താഴേക്ക്.\n\n നിങ്ങളുടെ കൈകളിലേക്ക് നിങ്ങളുടെ കൈകൾ മതിൽ നിന്ന് മുഴങ്ങുന്നു.\n ഈ സ്ഥാനം പിടിക്കുക.",
  'ex_desc_242': "മുട്ടുകുത്തി നിൽക്കുക, നിങ്ങളുടെ പാദങ്ങൾ പരന്നതല്ല.\n നിങ്ങളുടെ കൈകൾ തറയിൽ നിങ്ങളുടെ കൈകൾ നിരൂപിക്കുന്നു,\n\n\n\n\n\nSTRATH നിങ്ങളുടെ മുൻവശത്ത്\nsttet നിങ്ങളുടെ ചുമലിൽ.",
  'ex_desc_243': "നിങ്ങളുടെ കാലുകളുള്ള നുണപഴത്തിൽ ആരംഭിക്കുക നിങ്ങളുടെ വശങ്ങളിൽ ആയുധവും നിങ്ങളുടെ ഇടത് കാലും നിങ്ങളുടെ മുകളിലെ ശരീരവും ഉയർത്തി നിങ്ങളുടെ കാൽവിരലുകളിൽ നിന്ന് തൊടാൻ നിങ്ങളുടെ വലതു കൈ ഉപയോഗിക്കുക. മറ്റ് കാലിനൊപ്പം ആവർത്തിക്കുക.",
  'ex_desc_244': "നിങ്ങളുടെ കൈകൾ നിങ്ങളുടെ മുമ്പിൽ ഇരിക്കുക.\n\nനിങ്ങളുടെ കാലുകൾ നേരെയുമുള്ള, അത് നിലത്തുനിന്ന് ഉയർത്തുക. നിങ്ങളുടെ കാലുകളെ സർക്കിളുകളിൽ ഘടികാരദിശയിൽ നീക്കുക.",
  'ex_desc_245': "നിങ്ങളുടെ ശരീരത്തെ പിന്തുണയ്ക്കുന്നതിന് നിങ്ങളുടെ കാലുകൾ ഒരുമിച്ച് കുനിഞ്ഞ് നിങ്ങളുടെ കൈകൾ ഉപയോഗിച്ച് തറയിൽ ഇരിക്കുക. നിങ്ങളുടെ അരക്കെട്ട് നിങ്ങളുടെ അരക്കെട്ട് ഉയർത്തുമ്പോൾ ഒരു കാൽ ഉയർത്തുക, നിങ്ങൾക്ക് കഴിയുന്നത്ര ഉയരത്തിൽ. മറ്റ് കാലിലേക്ക് മാറുകയും ആവർത്തിക്കുകയും ചെയ്യുക. നിങ്ങളുടെ പുറകിൽ നിങ്ങളുടെ മുന്നിലേക്ക് നിങ്ങളുടെ ഇടുപ്പ് ഉപയോഗിച്ച് മുങ്ങും. ഇത് ഗ്ലൂയൂസിന്റെ മികച്ച വ്യായാമമാണ്.",
  'ex_desc_246': "നിങ്ങളുടെ ആയുധങ്ങൾ നേരായ ഓവർഹെഡ് വിപുലീകരിച്ച നിങ്ങളുടെ വയറ്റിൽ കിടക്കുക. നിങ്ങളുടെ എതിർവശത്ത് SRM, കാലിലേക്ക് മാറ്റുന്നു.",
  'ex_desc_247': "ഇരിക്കുക, പായയിൽ കാലുകൾ മുറിക്കുക. നിങ്ങളുടെ ഇടത് കൈ നിങ്ങളുടെ വലത്തോട്ടും നിങ്ങളുടെ വലതു കൈ തറയിൽ ഇടുക.",
  'ex_desc_248': "ഇരിക്കുക, പായയിൽ കാലുകൾ മുറിക്കുക. നിങ്ങളുടെ വലതു കൈ നിങ്ങളുടെ ഇടത് കാൽമുട്ടിലും നിങ്ങളുടെ ഇടത് കൈ തറയിൽ ഇടുക. നിങ്ങളുടെ മുകളിലെ ശരീരം ഇടതുവശത്തേക്ക് പതുക്കെ വളച്ചൊടിക്കുന്നു. കുറച്ച് നിമിഷങ്ങൾ കൈവശം വയ്ക്കുക.",

