  'plan_introduction_1': "3-10 മിനിറ്റ് കാര്യക്ഷമമായ വ്യായാമം കൊഴുപ്പ് കുറയ്ക്കാനും ഫിറ്റ്നസ് സൂക്ഷിക്കാനും സഹായിക്കുന്നു. നിങ്ങളുടെ ശരീരഭാരം കുറയ്ക്കാനുള്ള ലക്ഷ്യം വേഗത്തിൽ നേടുക!",
  'plan_introduction_2': "നിങ്ങളുടെ നിതംബം കർശനമാക്കുന്നതിനും ഉയർത്തുന്നതിനും 5-15 മിനിറ്റ് ലളിതമായ വർക്ക് outs ട്ടുകൾ. നന്നായി ആകൃതിയിലുള്ള ബട്ട് നേടുക!",
  'plan_introduction_3': "വയറ്റിൽ വയറിലെ കൊഴുപ്പ് നഷ്ടപ്പെടുകയും വീട്ടിൽ ഞങ്ങളുടെ ഹ്രസ്വവും ഫലപ്രദവുമായ വർക്ക് outs ട്ടുകൾ ഉപയോഗിച്ച് നിങ്ങളുടെ ടമ്മിയെ പരത്തുക! കുറച്ച് ആഴ്ചകളായി നിങ്ങൾക്ക് ഒരു പരന്ന വയറു ലഭിക്കും!",
  'plan_introduction_4': "പേശികൾ വളർത്തിയെടുക്കാനും ശക്തി മെച്ചപ്പെടുത്താനും സഹായിക്കുമെന്ന് ഈ വർക്ക് outs ട്ടുകൾ തെളിയിക്കപ്പെട്ടിട്ടുണ്ട്. ഉപകരണങ്ങളൊന്നും ആവശ്യമില്ല, നിങ്ങൾ ഉടൻ തന്നെ ഫലങ്ങൾ കാണും!",

  'plan_test_desc_1': "കണങ്കാലുകൾ തമ്മിലുള്ള ദൂരം 1.5 സെന്റിമീറ്റീവിലധികം കാലുകൾ നേരെയാകും, കാൽമുട്ടുകൾ പരസ്പരം അടുക്കുമ്പോൾ.\n\nknock-കാൽമുട്ട് ഒഎസാണ് കാൽമുട്ടുകൾ നിർത്തുക, കാലുകൾ നേരെയാക്കുമ്പോൾ പരസ്പരം സ്പർശിക്കുക.",
  'plan_test_desc_2': "നിങ്ങളുടെ കാൽക്കിടയിലുള്ള ദൂരം നിങ്ങളുടെ പാദങ്ങൾ ഒരുമിച്ച് അടുക്കുമ്പോൾ 3 സെന്റിമീറ്ററിൽ കൂടുതൽ തിരിച്ചറിയുന്നു. ഒരു വില്ലാളിയുടെ വില്ലിന്റെ രൂപം.",

  'plan_short_desc_5': "ഈ സെഷനിലെ വർക്ക് outs ട്ടുകൾ നിങ്ങളുടെ ശരീരത്തിലെ ഓരോ പേശിയും ഇടപഴകുക, നിങ്ങളുടെ വർക്ക് out ട്ട് ഫലം വർദ്ധിപ്പിക്കുകയും മൊത്തത്തിലുള്ള ഫിറ്റ്നസ് മെച്ചപ്പെടുത്തുകയും ചെയ്യുക.",
  'plan_short_desc_6': "എല്ലാ കോണുകളിൽ നിന്നും നിങ്ങളുടെ നിതംബവും കാലുകളും ടാർഗെറ്റുചെയ്യുക, നല്ല ആകൃതിയിലുള്ള കൊള്ളയും നേർത്ത കാലും നിങ്ങൾ ചിന്തിക്കുന്നതിനേക്കാൾ വേഗത്തിൽ നേടാൻ നിങ്ങളെ സഹായിക്കുന്നു!",
  'plan_short_desc_7': "കാണാവുന്ന നല്ല എബിഎസ് ആഗ്രഹിക്കുന്നവർക്കായി. തുടക്കക്കാർക്കും വ്യായാമ യോദ്ധാക്കൾക്കും യോജിക്കുന്നു.",
  'plan_short_desc_8': "ദ്രുത കൈ കൊഴുപ്പ് പൊള്ളലേറ്റ! നിങ്ങളുടെ ശരീരഭാരം ഉപയോഗിച്ച് മെലിഞ്ഞ് നിങ്ങളുടെ ആയുധങ്ങൾ ഇളക്കുക!",
  'plan_short_desc_9': "Energy ർജ്ജം ഉപയോഗിച്ച് ഉണരുക, നിങ്ങളുടെ ശരീരം ദിവസത്തിനായി പ്രൈം ചെയ്യുക.",
  'plan_short_desc_10': "സ്വയം വിശ്രമിക്കുക, ഉയർന്ന നിലവാരമുള്ള ഉറക്കം നേടുക.",
  'plan_short_desc_11': "വളവുകൾ ലഭിക്കാൻ സ്ത്രീകളെ സഹായിക്കുന്നതിന് 7 മിനിറ്റ് വ്യായാമം പ്രത്യേകമായി രൂപകൽപ്പന ചെയ്യുന്നു. ഈ വർക്ക് out ട്ട് നിങ്ങളുടെ നിതംബം, വയറു, കാലുകൾ മുതലായവ മൂടുന്നു.",
  'plan_short_desc_12': "ഏറ്റവും ഫലപ്രദമായ പൂർണ്ണമായ ശരീര വർക്ക് outs ട്ടുകൾ! ഒരു ചെറിയ വയറു, ഒരു റൗണ്ടർ ബൂട്ടി, ടൺ ബൂട്ടി, ടൺ എന്നിവ ഉപയോഗിച്ച് ആകർഷകമായ ശരീരം നേടാൻ ഒരു ദിവസം 7 മിനിറ്റ് കഴിക്കുക.",
  'plan_short_desc_13': "പേശികളെ അഴിച്ച് വേദന കുറയ്ക്കുക",
  'plan_short_desc_14': "ശരീരഭാരം കുറയ്ക്കുന്നതിനുള്ള ശക്തമായ തീവ്രമായ വ്യായാമം. ദിവസം മുഴുവൻ നിങ്ങൾക്ക് കലോറി കത്തിക്കാൻ കഴിയും!",
  'plan_short_desc_15': "ഫിറ്റ്നസ്, ആരോഗ്യം മെച്ചപ്പെടുത്തുമെന്ന് എസിഎസ്എം ഗവേഷണത്തെ അടിസ്ഥാനമാക്കി രൂപകൽപ്പന ചെയ്തത്.",
  'plan_short_desc_16': "കൊഴുപ്പ് കത്തുന്നതിനുള്ള ഏറ്റവും ഫലപ്രദമായ വ്യായാമം. ഉയർന്ന തീവ്രത\n ജോലിക്കാരുടെ ഉപാപചയ നിരക്ക് കുറഞ്ഞു. ഒഴികഴിവില്ലാത്ത 4\nmin മാത്രം!",
  'plan_short_desc_17': "നിങ്ങളുടെ മുഴുവൻ ശരീരത്തിനായുള്ള ഈ ഉയർന്ന തീവ്രത വ്യായാമം,\nനാരോബിക് വ്യായാമവുമായി കൂടിച്ചേർന്ന്, ഒരു വിക്ടോറിയയുടെ രഹസ്യം\nmodel പോലെ വലുതാക്കാൻ സഹായിക്കുന്നു!",
  'plan_short_desc_18': "വെറും 10 മിനിറ്റിനുള്ളിൽ 100 ​​കല്ല് കത്തിക്കുക! ഉയർന്ന തീവ്രമായ വ്യായാമവുമായി കാര്യക്ഷമത വർദ്ധിപ്പിക്കുക.",
  'plan_short_desc_19': "വേഗത്തിലും ഫലപ്രദമായും. വെറും 1 0 മിനിറ്റ് കലോറി ബേൺ വർദ്ധിപ്പിക്കുക\nനാന്ധൻ ഈ ഉയർന്ന തീവ്രത വ്യായാമത്തിലൂടെ നിങ്ങളുടെ മുഴുവൻ ശരീരത്തെ പരിശീലിപ്പിക്കുന്നു.",
  'plan_short_desc_20': "ആത്യന്തിക ഉയർന്ന തീവ്ര വർക്ക് outs ട്ടുകൾ കൂടുതൽ\nനകോളറികൾ നിങ്ങൾ കത്തിക്കുന്നു! പരിചയസമ്പന്നരായ വ്യായാമത്തിന് ക്രൂരമായ കൊഴുപ്പ് കത്തുന്ന പരിശീലനം.",
  'plan_short_desc_21': "നിങ്ങളുടെ കൊള്ളയെ ടാർഗെറ്റ് ചെയ്യുക, നിങ്ങളുടെ സെക്സി കർവുകൾ വർദ്ധിപ്പിക്കുന്നതിന് തുടയുടെ ടോണിംഗ് വ്യായാമം സംയോജിപ്പിക്കുക.",
  'plan_short_desc_22': "ചാടുകയില്ല! നിങ്ങളുടെ\nവ്യോമക്കാരെ രൂപപ്പെടുത്തുന്നതിനുള്ള കുറഞ്ഞ ഇംപാക്റ്റ് വ്യായാമം. ശബ്ദവും അപ്പാർട്ട്മെന്റും സൗഹൃദമില്ല.",
  'plan_short_desc_23': "ബ്രസീലിയൻ ബട്ട് ഇപ്പോൾ ഒരു സ്വപ്നമല്ല! ഒരു സെക്സിൻ, റൗണ്ടർ, ബിഗ് ബൂട്ടി ലഭിക്കാൻ നിങ്ങളുടെ നിതംബം എല്ലാ കോണുകളും പ്രയോജനപ്പെടുത്തുക.",
  'plan_short_desc_24': "3 മിനിറ്റ് തൽക്ഷണ വ്യായാമം മാത്രം! നിങ്ങളുടെ വിക്രാസി-തിരക്കേറിയ ഷെഡ്യൂൾ ഉണ്ടായിരുന്നിട്ടും നല്ലതായി കാണപ്പെടുന്ന ഒരു നിതംബം സ്കോർ ചെയ്യുക, നിങ്ങളുടെ വിഘടന സമയം ഉപയോഗിക്കുക!",
  'plan_short_desc_25': "തുടയുടെ വിടവ് വേണോ? ലക്ഷ്യമിട്ട വർക്ക് outs ട്ടുകൾ ആന്തരിക തുടയുടെ കൊഴുപ്പ് കത്തിക്കാൻ സഹായിക്കുന്നു. തുടക്കക്കാരൻ!",
  'plan_short_desc_26': "നിങ്ങളുടെ തുടയിൽ ശ്രദ്ധ കേന്ദ്രീകരിക്കുക, മികച്ച വ്യായാമം\nOU സർ കാലുകൾ ശക്തമാക്കാൻ സഹായിക്കുന്നു. നിങ്ങൾക്ക് ബിക്കിനി തയ്യാറാണ്!",
  'plan_short_desc_27': "7 മിനിറ്റിനുള്ളിൽ തുടയുടെ കൊഴുപ്പ് കത്തിക്കുക. കുറഞ്ഞ ഇംപാക്റ്റ് വ്യായാമം, അത് എല്ലാവർക്കുമായി സ്വാധീനിക്കാനാകില്ല, ദുർബലമായ കാൽമുട്ടുകളുള്ള ആളുകൾ പോലും.",
  'plan_short_desc_28': "തീവ്രമായ വ്യായാമം ആന്തരിക തുടയുടെ കൊഴുപ്പ് കത്തുന്നത് വർദ്ധിപ്പിക്കുക. ബൾകി പേശികളൊന്നുമില്ല!",
  'plan_short_desc_29': "7 മിനിറ്റ് ദ്രുത ബൂട്ടി വ്യായാമം. നിങ്ങളുടെ നിതംബങ്ങൾ കുറച്ചുകൂടി മുറുകെ പിടിക്കുക!",
  'plan_short_desc_30': "ഉയർന്ന തീവ്രത വർക്ക് outs ട്ടുകൾ നിങ്ങളുടെ നിതംബം കത്തിക്കുന്നു. നിങ്ങളുടെ നിതംബത്തിന്റെ വക്രം വർദ്ധിപ്പിക്കുക.",
  'plan_short_desc_31': "വിശ്രമിക്കാനും വഴക്കം സൃഷ്ടിക്കാനും നിങ്ങളെ സഹായിക്കുന്നു. പ്രവർത്തിക്കുന്നതിനും വ്യായാമത്തിനുമായി ഇത് ഒരു നല്ല സ്ട്രെച്ചക് ദിനചര്യയാണ്.",
  'plan_short_desc_32': "വിശ്രമിക്കാനും വഴക്കം സൃഷ്ടിക്കാനും നിങ്ങളെ സഹായിക്കുന്നു. പ്രവർത്തിക്കുന്നതിനും വ്യായാമത്തിനുമായി ഇത് ഒരു നല്ല സ്ട്രെച്ചക് ദിനചര്യയാണ്.",
  'plan_short_desc_33': "വേദന ഒഴിവാക്കുക, ദുർബലമായ കാൽമുട്ടുകൾ ശക്തിപ്പെടുത്തുക",
  'plan_short_desc_34': "വെറും നുരയെ റോളർ ഉപയോഗിച്ച് കാൽമുട്ടിന്റെ വേദന ഫലപ്രദമായി ഉരുട്ടുക",
  'plan_short_desc_35': "പ്രൊഫഷണൽ ഫിസിക്കൽ തെറപിസ്റ്റുകൾ രൂപകൽപ്പന ചെയ്ത പ്രത്യേക വർക്ക് outs ട്ടുകൾ, കാൽമുട്ടുകൾ ശരിയാക്കാനും നിങ്ങളുടെ ഗെയ്റ്റ് ശരിയാക്കാനും ലക്ഷ്യമിടുന്നു.",
  'plan_short_desc_36': "വകു കാലുകൾ ശരിയാക്കാനും നിങ്ങളുടെ ഗെയ്റ്റ് ശരിയാക്കാനും ലക്ഷ്യമിട്ട് പ്രൊഫഷണൽ ഫിസിക്കൽ തെറാപ്പിസ്റ്റുകൾ രൂപകൽപ്പന ചെയ്ത പ്രത്യേക വർക്ക് outs ട്ടുകൾ.",
  'plan_short_desc_37': "4 ലളിതമായ വ്യായാമങ്ങൾ മാത്രം! വയറിലെ കൊഴുപ്പും നിങ്ങളുടെ എബിഎമ്മിൽ ഉറച്ചതും. പരന്ന വയറു വേഗത്തിൽ നേടുക!",
  'plan_short_desc_38': "വയറിലെ കൊഴുപ്പിനും പലകകളുമായി പരസ്യങ്ങൾ വളർത്തുക. പിന്നിലേക്കും കഴുത്ത് പരിക്കുകൾ കുറയ്ക്കുക.",
  'plan_short_desc_39': "വയറിലെ കൊഴുപ്പ് കത്തിച്ച് നിങ്ങളുടെ നിതംബം കളിക്കുക. കുറഞ്ഞ ശ്രമം ഉപയോഗിച്ച് ശേഖരിക്കുക.",
  'plan_short_desc_40': "ദൃശ്യമായ എബിഡിന് ഒരു ദിവസം 7 മിനിറ്റ് മാത്രം! ഹ്രസ്വവും എളുപ്പവുമായ വ്യായാമം ആരംഭിക്കുക. ഒഴികഴിവുകളൊന്നുമില്ല!",
  'plan_short_desc_41': "കോർ പേശികളെ ശക്തിപ്പെടുത്തുന്നതിനും\nനെസ്റ്റ്ബിലിറ്റി മെച്ചപ്പെടുത്തുന്നതിനുമുള്ള ആത്യന്തിക കോർ വർക്ക് outs ട്ടുകൾ. ഉയർന്ന തീവ്രത വർക്ക് outs ട്ടുകൾ നിങ്ങളുടെ എബിഎമ്മിൽ തീയിടും!",
  'plan_short_desc_42': "പ്രധാന ശക്തി നേടാൻ പലകകൾ സഹായിക്കുകയും\nBAR, കഴുത്ത് പരിക്കുകളുടെ ചുരുങ്ങിയ അപകടസാധ്യതകൾ വർദ്ധിപ്പിക്കുകയും ചെയ്യുന്നു. ശക്തമായ ഒരു കാമ്പിനായി വെല്ലുവിളി എടുക്കുക!",
  'plan_short_desc_43': "കീറിപറിഞ്ഞ എബിഎസ് ആഗ്രഹിക്കുന്നുണ്ടോ? ഉയർന്ന തീവ്രത വർക്ക് out ട്ട് നിങ്ങളെ നിങ്ങളുടെ എബിഎല്ലിലെ പൊള്ളലേറ്റുചെയ്യുന്നു.",
  'plan_short_desc_44': "ബേൺ പ്രാബല്യത്തിന് ശേഷം ഉയർന്ന തീവ്രത വയറു കൊഴുപ്പ് കത്തുന്ന വർക്ക് outs ട്ടുകൾ. പരിശീലനത്തിനുശേഷവും കലോറി കത്തുന്ന കലോറി തുടരുക!",
  'plan_short_desc_45': "ബേൺ പ്രാബല്യത്തിന് ശേഷം ഉയർന്ന തീവ്രത വയറു കൊഴുപ്പ് കത്തുന്ന വർക്ക് outs ട്ടുകൾ. പരിശീലനത്തിനുശേഷവും കലോറി കത്തുന്ന കലോറി തുടരുക!",
  'plan_short_desc_46': "ബേൺ പ്രാബല്യത്തിന് ശേഷം ഉയർന്ന തീവ്രത വയറു കൊഴുപ്പ് കത്തുന്ന വർക്ക് outs ട്ടുകൾ. പരിശീലനത്തിനുശേഷവും കലോറി കത്തുന്ന കലോറി തുടരുക!",
  'plan_short_desc_47': "നിങ്ങളുടെ പ്രധാന പേശികളുടെ 100% കൂടുതലുള്ള പ്ലാങ്ക് വ്യതിയാനങ്ങൾ. കോർപ്പറയുന്നതിന് അനുയോജ്യമായതും താഴത്തെ നടുവേദന കുറയ്ക്കാൻ സഹായിക്കുന്നതും അനുയോജ്യമാണ്.",
  'plan_short_desc_48': "7 മിനിറ്റ് ഭുജത്തിന്റെ കൊഴുപ്പ് സ്ഫോടന വ്യായാമം! പ്രകാശപൂരിതവും മനോഹരവും മെലിഞ്ഞതുമായ ആയുധങ്ങൾ ഒഴിവാക്കുക.",
